st drop by your dentist? Buying a vehicle is an even bigger decision! Appointments are not just for the product advisor. They are for the comfort and convenience of other customers like yourself who also deserve excellent wait-free unhurried service. Do product advisors take walk-ins? Sure, but do yourself a favour and give them a heads up before you arrive.  Click the car icon to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Can I drop by next week? <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"New? Probably the vehicle you want is somewhere in the warehouse or in our regional network. Sometimes shortages can develop - but why not let us do the legwork? Come see a human and we will figure it out. Used? Decide what you want, and when you see it, snap it up. Used cars are one of a kind. Click the car icon to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> No one seems to have the vehicle I want <\\/a><\\/td>\\r\\n<td><a title=\\\"When you come to a dealership in person, this tells the seller you are ready to do business and are not just fishing. For this reason the best price is always when you come to the dealership. If you prefer to deal online, we suggest you try our chose-a-price service. Click the car icon to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Give me your best price <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"Modern cars have 50000 moving parts and are worth thousands of dollars, so value can only be roughly estimated from books alone. We wish life were simpler, but there is no substitute for having the vehicle examined by an expert, in person. Click the car icon to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Whats my trade worth? <\\/a><\\/td>\\r\\n<td><a title=\\\"We are sorry to hear that. Nobody is perfect. Any dealer participating in MyNextRide is committed to the highest levels of customer service. If you had a bad experience we want to hear about it.  Otherwise please contact one of our experienced and friendly product advisors.   Click the car icon to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I had a bad experience with a sales person <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"Even if the car is on the lot it will take about 2 days to get it ready for delivery.  It is a bit more complex than a supermarket checkout, but like a supermarket checkout, cars are queued for delivery in order. Otherwise delays can vary from a week or two if it is in the warehouse, to 3 to 4 months for a factory order. Click the car icon to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> How long will it take to get the car? <\\/a><\\/td>\\r\\n<td><a title=\\\"New cars are usually sold in mint condition with 5 to 125 km on them.  For this to be the case dealers must ship the cars from the factory on a delivery truck and handle them with care.  For full disclosure, this cost is itemized for the customer. If you hate the freight, consider buying a used vehicle. But click the car icon to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Why do I have to pay freight? <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<\\/tbody>\\r\\n<\\/table>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p><a href=\\\"#\\\"> Did we miss something? Maybe you need to talk to a human<\\/a><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"2\",\"created\":\"2014-12-22 12:57:26\",\"created_by\":\"152\",\"created_by_alias\":\"\",\"modified\":\"2014-12-22 13:05:32\",\"modified_by\":\"152\",\"checked_out\":\"152\",\"checked_out_time\":\"2014-12-22 13:05:21\",\"publish_up\":\"2014-12-22 12:57:26\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_layout\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"2\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\"}',0),(13,4,1,'','2014-12-26 01:02:19',152,11099,'d09be038951345550b989b7ed8d83d0f5c3101f5','{\"id\":4,\"asset_id\":\"82\",\"title\":\"Dilemma\",\"alias\":\"dilemma\",\"introtext\":\"<h2>Welcome to MyNextRide<\\/h2>\\r\\n<p><a title=\\\"Thanks for choosing MyNextRide. Everyone has problems right? No worries - we are problem solvers - just give us a clue \\\" href=\\\"#\\\" rel=\\\"tooltip\\\"><img src=\\\"templates\\/protostar\\/images\\/homerun.jpg\\\" alt=\\\"\\\" \\/><\\/a><\\/p>\\r\\n<p>hint: hover mouse cursor over the image to see advice<\\/p>\\r\\n<p><br \\/><br \\/><br \\/><\\/p>\\r\\n<table border=\\\"1\\\" cellpadding=\\\"10\\\">\\r\\n<tbody>\\r\\n<tr>\\r\\n<td><a title=\\\"Would you worry about wasting a doctors time if you were ill? We are professionals and are here to find you something which suits your needs and budget. If there is a real problem you can count on us to be upfront about it. Click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I dont want to waste your time <\\/a><\\/td>\\r\\n<td><a title=\\\"This is a situation we encounter often. Our financial professionals will go the extra mile to iron out any financial details and will be upfront about what is possible. Ask a sales advisor for further details. Click the button to let us know that you want to discuss this.\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I owe money on my last car <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"Congratulations! It is so nice to be able help people on an important occasion in their lives. We will do our very best to make sure it is a good experience. Click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> This is my first car <\\/a><\\/td>\\r\\n<td><a title=\\\"There are many reasons why people might pay slightly different prices, such as province of registration or a history of loyalty to a brand or dealership.  Car shoppers have always done some negotiation on the price.  If that is not your thing you may find MyNextRide can smooth out the road. Click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Is someone else getting a better price? <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"We understand that you have a busy life, and perhaps you divvy up the chores in your household so that one of you does the advance work.  But shopping for someone else\'s car can be like shopping for someone else\'s shoes.  If they do not fit, you are not doing them a favour. If someone is going to drive the car, it just makes sense to bring them in sooner rather than later. If you can do that we promise that the time and hassle you save will be worth the effort. But click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I\'m shopping for someone else <\\/a><\\/td>\\r\\n<td><a title=\\\"The car industry is extremely competitive and modern production techniques are extremely efficient.  The market keeps everyone honest.  The fair price of a vehicle is determined by the quality of the vehicle and the  demand for it.   Click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Your car X costs more than car Y <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"Whether you are spending 5 thousand or 50 thousand dollars on a vehicle, it is a big decision.  If you plan to  spend 25 thousand dollars on a car and skip a 10 minute test drive that could save you a bad decision - you are valuing your time at 41  dollars and 65 cents per second. Really? Nice work if you can get it! Take it from us - you will sleep easier if you try it out first. But click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I dont have time to test drive <\\/a><\\/td>\\r\\n<td><a title=\\\"No one likes to pay interest. But there are usually a few models available at 0 percent, or low interest rate financing. Otherwise remember to work out what you actually pay. A point or two of interest rate will likely amount to less than you think. Click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I dont want to pay any interest <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"We are sorry to hear that and hope everyone was ok.  There may be a period of uncertainty while insurance matters are cleared up. In the meantime you should know that car loans are open and can be paid off at any time. Therefore there is no compelling financial reason to wait for the insurance to clear before getting a replacement car. Click here to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I just wrote my car off <\\/a><\\/td>\\r\\n<td><a title=\\\"We understand that customers need to do some due diligence when looking at several models of vehicle. For the most part, those feature by features comparisons already exist on the internet. What a spreadsheet cannot do is represent your feelings about the vehicle.  These are important because it is likely going to be in your driveway for years. Click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> We are making a spreadsheet of cars <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"No problem! Lets take the vehicle to your house and try it out. But click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Will this car fit in my garage? <\\/a><\\/td>\\r\\n<td><a title=\\\"Would you just drop by your dentist? Buying a vehicle is an even bigger decision! Appointments are not just for the product advisor. They are for the comfort and convenience of other customers like yourself who also deserve excellent wait-free unhurried service. Do product advisors take walk-ins? Sure, but do yourself a favour and give them a heads up before you arrive.  Click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Can I drop by next week? <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"New? Probably the vehicle you want is somewhere in the warehouse or in our regional network. Sometimes shortages can develop - but why not let us do the legwork? Come see a human and we will figure it out. Used? Decide what you want, and when you see it, snap it up. Used cars are one of a kind. Click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> No one seems to have the vehicle I want <\\/a><\\/td>\\r\\n<td><a title=\\\"When you come to a dealership in person, this tells the seller you are ready to do business and are not just fishing. For this reason the best price is always when you come to the dealership. If you prefer to deal online, we suggest you try our chose-a-price service. Click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Give me your best price <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"Modern cars have 50000 moving parts and are worth thousands of dollars, so value can only be roughly estimated from books alone. We wish life were simpler, but there is no substitute for having the vehicle examined by an expert, in person. Click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Whats my trade worth? <\\/a><\\/td>\\r\\n<td><a title=\\\"We are sorry to hear that. Nobody is perfect. Any dealer participating in MyNextRide is committed to the highest levels of customer service. If you had a bad experience we want to hear about it.  Otherwise please contact one of our experienced and friendly product advisors.   Click the button to let us know that you want to discuss this \\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> I had a bad experience with a sales person <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td><a title=\\\"Even if the car is on the lot it will take about 2 days to get it ready for delivery.  It is a bit more complex than a supermarket checkout, but like a supermarket checkout, cars are queued for delivery in order. Otherwise delays can vary from a week or two if it is in the warehouse, to 3 to 4 months for a factory order. Click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> How long will it take to get the car? <\\/a><\\/td>\\r\\n<td><a title=\\\"New cars are usually sold in mint condition with 5 to 125 km on them.  For this to be the case dealers must ship the cars from the factory on a delivery truck and handle them with care.  For full disclosure, this cost is itemized for the customer. If you hate the freight, consider buying a used vehicle. But click the button to let us know that you want to discuss this\\\" href=\\\"#\\\"> <img src=\\\"templates\\/protostar\\/images\\/info.png\\\" alt=\\\"\\\" \\/> Why do I have to pay freight? <\\/a><\\/td>\\r\\n<\\/tr>\\r\\n<\\/tbody>\\r\\n<\\/tab