>\\nVehicleManager permite que voc gerencie grandes catlogos de veculos. Ele possui suporte a categoria e subcategoria e voc pode adicionar uma ID de veculos para sua referncia interna. Gesto de Aluguel vem incorporado, com a possibilidade de solicitao de aluguel para os usurios do Web site. VehicleManager tambm oferece a possibilidade de revises de veculo por usurios, com gerenciamento de reviso no backend. O suporte a edocument  construido internamente. Informaes de veculos e fotos dos mesmos podem ser inseridas manualmente. <br/ ><br />\\nNOTES: <br/ >\\n- para o download de fotos funcionarem corretamente em seu servidor, voc precisa compilar PHP5 com suporte a CURL<br />\\n- Para que as exportaes em CSV funcionem, voc necessita complilar PHP5 com supporte a XSL<br/ >\\n- Para que o CAPTCHA funcione, voc necessita compilar PHP5 com suporte a GD<br />\\n<br />\\nNo website <a href=\\\"http://www.ordasoft.com\\\">www.ordasoft.com</a> voc poder encontra os manuais do VehicleManager, arquivos de linguagens adicionais, Fruns de Suporte e tambm poder baixar mdulos adicionais e plug-ins.<br />\\n<br />\\nEstamos disponveis para novos desenvolvimentos, caso voc queira novos recursos adicionados ao VehicleManager. Por gentileza envie seus pedidos para <a href=\\\"mailto:sales@ordasoft.com\\\">sales@ordasoft.com</a> e ns iremos retornar com uma citao. Quando voc ordena uma customizao paga ir receber sua prxima verso PRO com seu pedido de customizao adicionado.'),(1133,286,3,'Os campos abaixo s precisam ser preenchidos manualmente quando voc tiver definido '),(1134,287,3,'. caso contrrio, eles sero ignorados.'),(1135,288,3,'Pedido de Locao'),(1136,289,3,'A lista mostra os veculos selecionados para alugar.<br />Se estiver vazio, por gentileza verifique novamente sua seleo.'),(1137,290,3,'Seu nome completo'),(1138,291,3,'E-mail'),(1139,292,3,'Seu endereo de correspondncia postal'),(1140,293,3,'Data de devoluo do veculo'),(1141,294,3,'Alugado de'),(1142,295,3,'Sua solicitao de