mir'),(1178,331,3,'Por favor, selecione as colunas para impresso e, em seguida, clique em [ Prximo ]!'),(1179,332,3,'Tamanho da fonte'),(1180,333,3,'Formato'),(1181,334,3,' Mostrar a licena de download do documento eletrnico'),(1182,335,3,'Mostrar o aceite da licena de download do documento eletrnico/recusar antes de permitir o download do documento eletr6onico a partir do frontend'),(1183,336,3,'Mostar a licena de download do documeto eletrnico'),(1184,337,3,'Contrato de licena'),(1185,338,3,'Aceitar?'),(1186,339,3,'[ Adicionar reviso ]'),(1187,340,3,'[ Ocultar reviso ]'),(1188,341,3,'[ Sugerir veculo ]'),(1189,342,3,'Veculo de sugesto'),(1190,343,3,'Ttulo de sugesto'),(1191,344,3,'Comentrio de sugesto'),(1192,345,3,'Por gentileza, entre um Ttulo para sua sugesto!'),(1193,346,3,'Por gentileza, entre um Texto para sua sugesto!'),(1194,347,3,'VehicleManager :: Sugestes'),(1195,348,3,'Excluir Sugesto'),(1196,349,3,'Vizualizar sugesto'),(1197,350,3,'Mostar boto [ Comprar agora ]'),(1198,351,3,'mostrar boto [ Comprar agora ]'),(1199,352,3,'Mostra o boto [ Comprar agora ] prximo ao veculo no frontend'),(1200,353,3,'Permitir boto [ Comprar agora ]:'),(1201,354,3,'Mostrar boto [Comprar agora] no frontend para as categorias selecionadas. Esta funo ser ativada apenas se --Mostrar boto [Comprar agora]-- tambm estiver definida como SIM! Voc pode selecionar vrias categorias.'),(1202,355,3,'Permitir boto [ Comprar agora ]'),(1203,356,3,'Exportao de dados completa'),(1204,357,3,'Importao de dados completa'),(1205,358,3,'Esta operao ir remover TODOS os dados do VehicleManager existentes antes de importar. Voc deseja continuar?'),(1206,359,3,'[ Ocultar sugesto ]'),(1207,360,3,'Mostrar boto <br />[ Sugerir Veculo ]'),(1208,361,3,'Mostrar boto <br />[ Sugerir Veculo ]'),(1209,362,3,'Mostrar boto [ Sugerir Veculo ] na lista de veculo e os detalhes do veculo no frontend'),(1210,363,3,'Permitir boto<br />[ Sugerir Veculo ]'),(1211,364,3,'Permitir boto<br />[ Sugerir Veculo ]'),(1212,365,3,'Permitir boto<br />[ Sugerir Veculo ] no frontend. Esta funo ser ativada somente se --Mostrar boto [ Sugerir Veculo ]-- tambm estiver definido para SIM!'),(1213,366,3,'\\n<strong>CSV&nbsp;IMPORTAR:</strong>\\n<ul>\\n	<li>No momento o seguinte formato CSV  suportado:&nbsp;&nbsp;ID do Veculo&nbsp;|&nbsp;Descrio&nbsp;|&nbsp;Link&nbsp;|&nbsp;Modelo&nbsp;|&nbsp;Tipo de Veculo&nbsp;|&nbsp;Tipo de listagem&nbsp;|&nbsp;Preo&nbsp;|&nbsp;Tipo de preo&nbsp;|&nbsp;Ttulo de Veculo&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Campos so separados por um caractere de pipe (<strong>&nbsp;|&nbsp;</strong>)</li>\\n	<li>Voc pode importar uma lista toda com apenas a ID do Veculo, deixando os outros campos vazios, por exemplo:&nbsp;&nbsp;ID do Veculo&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;Modelo&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;Preo&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li><strong>AVISO:</strong>&nbsp; no utilize importar CSV se houverem Revises de Veculos presentes, neste caso utilize a importao de dados completa!</li>\\n</ul>\\n<strong>XML&nbsp;IMPORTAR:</strong>\\n<ul>\\n	<li>importar em XML format</li>\\n	<li><strong>AVISO:</strong>&nbsp; no utilize importar XML se houverem Revises de Veculos presentes, neste caso utilize a importao de dados completa!</li>\\n <li><strong>AVISO:</strong>&nbsp;associaes entre as casas no sero salvos!</li>\n        <li><strong>AVISO:</strong>&nbsp;voc tem que fazer upload de imagens isoladamente, no h fotos sero salvas!</li></ul>\\n<strong>IMPORTAO&nbsp;COMPLETA&nbsp;DE DADOS:</strong>\\n<ul>\\n	<li>Esta importao ir importar todos os dados do VehicleManager e restaurar todos os campos e detalhes</li>\\n	<li>Esta opo ir substituir TODAS as entradas j existentes, portanto, tenha cuidado antes de a utilizar!</li>\\n	<li>Para salvar todas as fotos de veculos, por gentileza salve todos os arquivos da pasta: --components/com_vehiclemanager/photos--!</li>\\n	<li>Para salvar todos os documentos eletrnicos dos veculos, por gentileza salve todos os arquivos da pasta que voc selecionou para as definies do backend --Localizao de documentos '),(1214,367,3,'\\n<strong>CSV&nbsp;EXPORTAR:</strong>\\n<ul>\\n	<li>Exportao do CSV ir conter todos os campos para posterior edio adicional em um editor de texto ou um aplicativo de planilha</li>\\n	<li>Note, por gentileza, que para importaes subsequentes, somente o seguinte formato CSV  suportado: :&nbsp;&nbsp;ID do Veculo&nbsp;|&nbsp;Descrio&nbsp;|&nbsp;Link&nbsp;|&nbsp;Modelo&nbsp;|&nbsp;Tipo de Veculo&nbsp;|&nbsp;Tipo de listagem&nbsp;|&nbsp;Prio&nbsp;|&nbsp;Tipo de preo&nbsp;|&nbsp;Ttulo do Veculo&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Voc tambm pode importar mais tarde incluindo Revises de Veculos. Use exportao COMPLETA ao invs!</li>\\n</ul>\\n<strong>XML&nbsp;EXPORTAO:</strong>\\n<ul>\\n	<li>Exportao XML  a maneira preferida para exportar veculos com Descrio de Veculos</li>\\n	<li>Exportao XML com certeza ir conter todos os detalhes dos veculos, inlcuindo Descries, prontas para posteriores importaes</li>\\n <li><strong>AVISO:</strong>&nbsp;associaes entre as casas no sero salvos!</li>\n        <li><strong>AVISO:</strong>&nbsp;voc tem que fazer upload de imagens isoladamente, no h fotos sero salvas!</li></ul>\\n<strong>EXPORTAO&nbsp;COMPLETA&nbsp;DE DADOS:</strong>\\n<ul>\\n	<li>Esta exportao ir exportar todos os dados do VehicleManager e salvar todos os campos e entradas</li>\\n	<li>Mais tarde voc pode usar esses arquivos para restaurar os dados do VehicleManager na ntegra</li>\\n	<li>Esta importao subsequente ir substituir TODAS as entradas j existentes, portanto, cuidado ao us-lo!</li>\\n	<li>Para restaurar todas as fotos do veculo, por gentileza restaure todos os arquivos da pasta: --components/com_vehiclemanager/photos--!</li>\\n	<li>Para restaurar todos os documentos eletrnicos, por gentileza restaure todos os arquivos da pasta que selecionou nas [Definies de Backend] -- [Localizao de documentos eletrnicos]</li>\\n</ul>'),(1215,368,3,'Enviar Notificaes de Reviso'),(1216,369,3,'Enviar Notificaes de Reviso'),(1217,370,3,'Defina como SIM se voc deseja ser notificado por e-mail quando um usurio adiciona uma Reviso de Veculos. Use o painel  direita para definir quem vai enviar essas notificaes. Voc pode definir os endereos de e-mail de recebimento em [ Configurao do Backend ].'),(1218,371,3,'Grupos de usurios, dos quais, notificaes de Reviso sero enviadas'),(1219,372,3,'Grupos de usurios, dos quais, notificaes de Reviso sero enviadas'),(1220,373,3,' Escolha qual grupo de usurios ir enviar notificaes de Reviso. Esta funo somente ser ativada se --Enviar Notificao de Reviso-- tambm estiver definido como SIM'),(1221,374,3,'Enviar Notificao de Sugesto'),(1222,375,3,'Enviar Notificao de Sugesto'),(1223,376,3,'Definir como SIM caso queira ser notificado por e-mail quando um usurio adicionar uma Sugesto de Veculo. Use o painel  direita para definir quem ir enviar estas notificaes. Voc pode definir os endereos de e-mail de recebimento em [ Configurao de Backend ].'),(1224,377,3,'Grupos de usurios, dos quais, notificaes de Sugesto sero enviadas'),(1225,378,3,'Grupos de usurios, dos quais, notificaes de Sugesto sero enviadas'),(1226,379,3,'Escolha qual grupo de usurios ir enviar notificaes de Sugesto. Esta funo somente ser ativada se --Enviar Notificao de Sugesto-- tambm estiver definido como SIM'),(1227,380,3,'Enviar Notificao de Solicitao de Aluguel'),(1228,381,3,'Enviar Notificao de Solicitao de Aluguel'),(1229,382,3,'Definir como SIM caso queira ser notificado por e-mail quando um usurio adicionar um Pedido de Locao. Use o painel  direita para definir quem ir enviar estas notificaes. Voc pode definir os endereos de e-mail de recebimento em [ Configurao de Backend ].'),(1230,383,3,'Grupos de usurios, dos quais, Pedido de Locao sero enviados'),(1231,384,3,'Grupos de usurios, dos quais, Pedido de Locao sero enviados'),(1232,385,3,'Escolha qual grupo de usurios ir enviar notificaes de Pedido de