rt and you can add a VehicleID for your internal reference. Rent management is built-in, with a rent request possibility for users of your website. VehicleManager also offers the possibility of vehicle reviews by users, with review management in the backend. Edocument support is built-in. Vehicle information and vehicle photos can be entered manually. <br/ ><br />\\r\\nNOTES: <br/ >\\r\\n- for the download of photos to your server to work, you need to compile PHP5 with CURL support<br />\\r\\n- for CSV export to work, you need to compile PHP5 with XSL support<br/ >\\r\\n- for CAPTCHA to work, you need to compile PHP5 with GD support<br />\\r\\n<br />\\r\\nOn the website <a href=\\\"http://www.ordasoft.com\\\">www.ordasoft.com</a> you can find VehicleManager Manuals, additional Language files, Support Forums and also download additional modules and plugins.<br />\\r\\n<br />\\r\\nWe are available for Custom Development if you want a new feature added to VehicleManager. Please mail your exact requirements to <a href=\\\"mailto:sales@ordasoft.com\\\">sales@ordasoft.com</a> and we will get back to you with a quote. When you order a paid Customisation, you will receive the next PRO version with your custom feature added.'),(1980,286,4,'The fields below only need to be filled in manually when you have set '),(1981,287,4,'. otherwise they will be ignored.'),(1982,288,4,'Lejeforesprgsel'),(1983,289,4,'Listen viser Kretj valgt til udlejning.<br />Hvis listen er tom, tjekk dine valg igen.'),(1984,290,4,'Fulde navn'),(1985,291,4,'email'),(1986,292,4,'Din postadresse'),(1987,293,4,'Returdato for leje.'),(1988,294,4,'Leje fra'),(1989,295,4,'Din foresprgsel er gemt i vores database. Vi kommer tilbage med et svar s hurtigt som muligt..<br />Tak for at du benytter vores tjeneste.'),(1990,296,4,'Din foresprgsel om kb er gemt, vi kommer tilbage med et svar s hurtigt som muligt.<br />Tak for at du benytter vores tjeneste'),(1991,297,4,'Dit foreslag er registreret i vores database.<br />Tak for at du benytter vores tjeneste.'),(1992,298,4,'Kretjs Manager: Lejeforesprgselen er accepteret'),(1993,299,4,'Kretjet'),(1994,300,4,'Kretjet du har nsket er allerede udlejet.'),(1995,301,4,'Gem'),(1996,302,4,'Lej Kretj'),(1997,303,4,'Retur af udlejet Kretj'),(1998,304,4,'Godkend foresprgsel'),(1999,305,4,'Afvis foresprgsel'),(2000,306,4,'Importer Kretj'),(2001,307,4,'Eksporter Kretj'),(2002,308,4,'Slet anmeldelse'),(2003,309,4,'Rediger anmeldelse'),(2004,310,4,'Generell information:'),(2005,311,4,'Version:'),(2006,312,4,'Udgivelsesdato:'),(2007,313,4,'Projektlink:'),(2008,314,4,'Projekt host:'),(2009,315,4,'Licens:'),(2010,316,4,'This program is distributed in the hope that it will be useful, but without any warranty. See the included LICENSE.TXT for more details.'),(2011,317,4,'Udviklet af:'),(2012,318,4,'Hjemmeside'),(2013,319,4,'URL til e-dokumentets downloadlink'),(2014,320,4,'Tillad download af e-dokumenter'),(2015,321,4,'Tillad download af e-dokumenter p siden. Funktionen krver at --Vis link til download af e-dokument-- ogs sttes til JA'),(2016,322,4,'Tillad e-dokument downloads'),(2017,323,4,'Tillad pris:'),(2018,324,4,'Tillad pris p siden. Funktionen krver at--Vis pris-- ogs er sat til JA!'),(2019,325,4,'Tilladt pris'),(2020,326,4,'Kretjs Manager :: Anmeldelser'),(2021,327,4,'Tittel p Kretj'),(2022,328,4,'Tittel p kommentar'),(2023,329,4,'Indtast bokstaverne og tallene som vises i billedet ovenfor, i boksen under.'),(2024,330,4,'Print'),(2025,331,4,'Vlg de kolonner som skal printes og vlg [ Nste ]!'),(2026,332,4,'Font strrelse'),(2027,333,4,'Format'),(2028,334,4,'Vis e-dokumentets download betingelser'),(2029,335,4,'Vis e-dokumentets download betingelser accepter/accepter ikke fr e-dokumentet kan downloades p siden.'),(2030,336,4,'Vis e-dokumentets download betingelser'),(2031,337,4,'Lisense Agreement'),(2032,338,4,'Accepter?'),(2033,339,4,'[ Tilfj anmeldelse ]'),(2034,340,4,'[ Skjul anmeldelse ]'),(2035,341,4,'[ Forsl Kretj ]'),(2036,342,4,'Kretj forslag'),(2037,343,4,'Forslagstittel'),(2038,344,4,'Kommentar til forslaget'),(2039,345,4,'Tilfj tittel til forslaget!'),(2040,346,4,'Tilfj tekst til dit forslaget!'),(2041,347,4,'Kretjs Manager :: Forslag'),(2042,348,4,'Slet forslag'),(2043,349,4,'Vis forslag'),(2044,350,4,'Show button [ Kb nu ]'),(2045,351,4,'Vis knap [ Kb nu ]'),(2046,352,4,'Vis knap [ Kb nu ] ved siden af Kretjet p siden'),(2047,353,4,'Tillad knappen [ Kb nu ]:'),(2048,354,4,'Vis knappen [ Kb nu ] p siden for valgte kategorier. Funktionen aktiveres kun hvis --Vis knappen [ Kb nu ]-- ogs er sat til JA! Du kan vlge flere kategorier.'),(2049,355,4,'Tillad knappen [ Kb nu ]'),(2050,356,4,'Full dataeksport'),(2051,357,4,'Full dataimport'),(2052,358,4,'Denne operation sletter ALLE data fr import. Vil du fortstte?'),(2053,359,4,'[ Skjul forslag ]'),(2054,360,4,'Vis knappen<br />[ Foresl Kretj ]'),(2055,361,4,'Vis knappen<br />[ Foresl Kretj ]'),(2056,362,4,'Vis knappen [ Foresl Kretj ] i Kretjs liste og detaljer p siden'),(2057,363,4,'Tillad knappen<br />[ Foresl Kretj ]'),(2058,364,4,'Tillad knappen<br />[ Foresl Kretj ]'),(2059,365,4,'Tillad knappen [ Foresl Kretj ] p siden. Denne funktion aktiveres kun hvis --Vis knappen [ Foresl Kretj ]-- ogs er sat til JA!'),(2060,366,4,'\\r\\n<strong>CSV&nbsp;IMPORT:</strong>\\r\\n<ul>\\r\\n	<li>At the moment the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li>Fields are separated by a pipe character (<strong>&nbsp;|&nbsp;</strong>)</li>\\r\\n	<li>You can import a whole list with just VehicleID by leaving the other fields empty, for example:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Price&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li><strong>WARNING:</strong>&nbsp;do not use CSV import if there are Vehicle Reviews present, in that case use full data import!</li>\\r\\n</ul>\\r\\n<strong>XML&nbsp;IMPORT:</strong>\\r\\n<ul>\\r\\n	<li>import in XML </li>\\r\\n	<li><strong>WARNING:</strong>&nbsp;do not use XML import if there are Vehicle Reviews present, in that case use full data import!</li>\\r\\n <li><strong>ADVARSEL:</strong>&nbsp;associationer mellem husene vil ikke blive gemt!</li>\n        <li><strong>ADVARSEL:</strong>&nbsp;du ndt til at uploade billeder enkeltvis, vil ingen billeder blive gemt!</li></ul>\\r\\n<strong>FULL&nbsp;DATA&nbsp;IMPORT:</strong>\\r\\n<ul>\\r\\n	<li>This import will import all VehicleManager data and restore all fields and details</li>\\r\\n	<li>This option will overwrite ALL existing entries, so be careful when using it!</li>\\r\\n	<li>For save all Vehicles photos, please save all files from folder: --components/com_vehiclemanager/photos--!</li>\\r\\n	<li>For save all Vehicles eDocuments, please save all files from folder what you set in  setting backent --Location of edocuments--!</li>\\r\\n</ul>'),(2061,367,4,'\\r\\n<strong>CSV&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>CSV export will contain all fields for further editing in a text editor or spreadsheet application</li>\\r\\n	<li>Please note that for subsequent import, only the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li>You can also import later including Vehicle Reviews, use FULL export instead!</li>\\r\\n <li><strong>ADVARSEL:</strong>&nbsp;associationer mellem husene vil ikke blive gemt!</li>\n        <li><strong>ADVARSEL:</strong>&nbsp;du ndt til at uploade billeder enkeltvis, vil ingen billeder blive gemt!</li></ul>\\r\\n<strong>XML&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>XML export is the preferred way to export vehicles with Vehicle Descriptions</li>\\r\\n	<li>XML export will contain all vehicle details, including Descriptions, ready for later import</li>\\r\\n</ul>\\r\\n<strong>FULL&nbsp;DATA&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>This export will export all VehicleManager data and save all fields and entries</li>\\r\\n	<li>You can later use these files to restore your VehicleManager data in full</li>\\r\\n	<li>This subsequent import will overwrite ALL existing entries, so be careful when using it!</li>\\r\\n	<li>To restore all vehicle photos, please restore all files from folder: --components/com_vehiclemanager/photos--!</li>\\r\\n	<li>To restore all vehicle eDocuments, please restore all files from the folder you have set in [Settings Backend] -- [Location of edocuments]</li>\\r\\n</ul>'),(2062,368,4,'Send anmeldelses advisering'),(2063,369,4,'Send anmeldelses advisering'),(2064,370,4,'Indstil til JA hvis du nsker at blive underrettet via e-mail, nr en bruger tilfjer en Kretjs anmeldelse. Brug panelet til hjre for at indstille hvem der skal sende disse meddelelser. Du kan indstille den modtagende e-mail-adresser i [ Configuration Backend ].'),(2065,371,4,'Brugergrupper, hvorfra Review anmeldelser vil blive sendt'),(2066,372,4,'Brugergrupper, hvorfra Review anmeldelser vil blive sendt'),(2067,373,4,'Vlg hvilke brugergrupper som vil sende Review adviseringer. Denne funktion er kun aktiv, hvis - Send Review Anmeldelse - ogs er indstillet til YES'),(2068,374,4,'Send Forslags advisering'),(2069,375,4,'Send Forslags advisering'),(2070,376,4,'Indstil til JA hvis du nsker at blive underrettet via e-mail, nr en bruger tilfjer en kretjs forslag. Brug panelet til hjre for at indstille hvem der skal sende disse meddelelser. Du kan indstille den modtagende e-mail-adresser i [ Configuration Backend ].'),(2071,377,4,'Brugergrupper hvorfra forslags adviseringer bliver sendt'),(2072,378,4,'Brugergrupper hvorfra forslags adviseringer bliver s