'Huuraanvraag e-mail'),(2818,277,5,'Huuraanvraag e-mail'),(2819,278,5,'E-mail adres waar de notificaties heengaan zodra er een nieuwe Huuraanvraag is ingediend. Meerdere e-mailadressen opgeven kan door te scheiden met een komma.'),(2820,279,5,'VoertuigManager :: Huuraanvragen'),(2821,280,5,'VoertuigManager :: About'),(2822,281,5,'About'),(2823,282,5,'Release note'),(2824,283,5,'Changelog'),(2825,284,5,'Welkom bij de VoertuigManager'),(2826,285,5,'Bedankt voor het installeren van dit component!<br /><br />\\nMet VoertuigManager kunt u grote voertuig catalogussen beheren. U kunt een VoertuigID invoeren voor uw interne referentie en het programma ondersteunt categorin en subcategorin. Verhuur management is standaard ingebouwd, met huuraanvraag opties voor bezoekers van uw website. Gebruikers kunnen voertuigen beoordelen, en administrators kunnen de beoordelingen beheren vanuit het backend. Ondersteuning voor E-docs. Voertuig informatie en foto\'s kunnen handmatig toegevoegd worden. <br/ ><br />\\nNOTES: <br/ >\\n- for the download of photos to your server to work, you need to compile PHP5 with CURL support<br />\\n- for CSV export to work, you need to compile PHP5 with XSL support<br/ >\\n- for CAPTCHA to work, you need to compile PHP5 with GD support<br />\\n<br />\\nOn the website <a href=\\\"http://www.ordasoft.com\\\">www.ordasoft.com</a> you can find VoertuigManager Manuals, additional Language files, Support Forums and also download additional modules and plugins.<br />\\n<br />\\nWe are available for Custom Development if you want a nieuw feature added to VoertuigManager. Please mail your exact requirements to <a href=\\\"mailto:sales@ordasoft.com\\\">sales@ordasoft.com</a> and we will get back to you with a quote. When you order a paid Customisation, you will receive the next PRO version with your custom feature added.'),(2827,286,5,'Onderstaande velden hoeven alleen handmatig ingevuld te worden in geval van '),(2828,287,5,'. In andere gevallen worden deze velden genegeerd.'),(2829,288,5,'Huuraanvraag'),(2830,289,5,'De lijst toont de geselecteerde huurauto\'s. <br />Als deze leeg is, check dan a.u.b. uw selectiecriteria.'),(2831,290,5,'Naam (voluit geschreven)'),(2832,291,5,'e-mail'),(2833,292,5,'Uw postadres'),(2834,293,5,'Retourdatum voertuig'),(2835,294,5,'Huren vanaf'),(2836,295,5,'Uw huuraanvraag is opgeslagen in onze database. De aanvraag wordt gecontroleerd waarna u wordt genformeerd.<br />Bedankt voor uw aanvraag.'),(2837,296,5,'Uw koopaanvraag is opgeslagen in onze database. De aanvraag wordt gecontroleerd waarna u wordt genformeerd.<br />Bedankt voor uw aanvraag.'),(2838,297,5,'Uw suggestie is opgeslagen.<br />Bedankt voor uw suggestie.'),(2839,298,5,'VoertuigManager: Huuraanvraag geaccepteerd'),(2840,299,5,'Het voertuig'),(2841,300,5,'dat u hebt aangevraagd staat klaar voor verhuur.'),(2842,301,5,'Opslaan'),(2843,302,5,'Huur voertuig'),(2844,303,5,'Voertuig innemen uit verhuur'),(2845,304,5,'Accepteer aanvraag'),(2846,305,5,'Afwijzen aanvraag'),(2847,306,5,'Import voertuigen'),(2848,307,5,'Export voertuigen'),(2849,308,5,'Verwijder beoordeling'),(2850,309,5,'Wijzig beoordeling'),(2851,310,5,'Algemene informatie:'),(2852,311,5,'Versie:'),(2853,312,5,'Release datum:'),(2854,313,5,'Project link:'),(2855,314,5,'Project host:'),(2856,315,5,'Licentie:'),(2857,316,5,'Dit programma wordt gedistribueerd met de intentie dat het bruikbaar is, zonder enigerlei vorm van garantie. Zie bijgevoegde LICENSE.TXT voor de details.'),(2858,317,5,'Ontwikkeld door:'),(2859,318,5,'Website'),(2860,319,5,'e-document Download Link URL'),(2861,320,5,'e-docs downloaden toestaan'),(2862,321,5,'Downloaden van e-docs toestaan in frontend. Alleen geactiveerd indien --Toon e-docs Download Link-- ook op JA staat'),(2863,322,5,'Download e-docs toestaan'),(2864,323,5,'Prijs weergeven:'),(2865,324,5,'Prijs weergeven toestaan in frontend. Alleen geactiveerd indien --Prijs weergeven-- ook op JA staat'),(2866,325,5,'Prijs weergeven'),(2867,326,5,'Voer