/>[ Suggest Vehicle ]'),(2906,365,5,'Toestaan button [ Voertuig aanvragen ] in het frontend. Alleen geactiveerd indien --Toon button [ Voertuig aanvragen ]-- ook op JA staat.'),(2907,366,5,'\\n<strong>CSV&nbsp;IMPORT:</strong>\\n<ul> <li>Op dit moment wordt de volgende CSV-bestandsindeling ondersteund:&nbsp;&nbsp;VoertuigID&nbsp;|&nbsp;Omschrijving&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Voertuig type&nbsp;|&nbsp;Lijst type&nbsp;|&nbsp;Prijs&nbsp;|&nbsp;Prijs type&nbsp;|&nbsp;Voertuignaam&nbsp;|&nbsp;...&nbsp;|</li> <li>Velden worden gescheiden door een rechtop staand streepje (<strong>&nbsp;|&nbsp;</strong>)</li> <li>U kunt ook lijsten importeren met alleen het VoertuigID en de andere velden leeg laten, bijvoorbeeld:&nbsp;&nbsp;VoertuigID&nbsp;|&nbsp;<i>leeg</i>&nbsp;|&nbsp;<i>leeg</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>leeg</i>&nbsp;|&nbsp;<i>leeg</i>&nbsp;|&nbsp;Prijs&nbsp;|&nbsp;<i>leeg</i>&nbsp;|&nbsp;...&nbsp;|</li> <li><strong>LET OP:</strong>&nbsp;gebruik geen CSV import indien er Voertuig Beoordelingen in staan, gebruik in dat geval de volledige data import!</li>\\n</ul>\\n<strong>XML&nbsp;IMPORT:</strong>\\n<ul> <li>import in XML </li> <li><strong>PAS OP:</strong>&nbsp;samband mellan husen kommer inte att sparas!</li>\n        <li><strong>PAS OP:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li><li><strong>LET OP:</strong>&nbsp;gebruik geen CSV import indien er Voertuig Beoordelingen in staan, gebruik in dat geval de volledige data import!</li>\\n</ul>\\n<strong>VOLLEDIGE&nbsp;DATA&nbsp;IMPORT:</strong>\\n<ul> <li>Hiermee importeert u alle VoertuigManager data en zet u de backup terug in de database</li> <li>This option will overwrite ALL existing entries, so be careful when using it!</li> <li>For save all Vehicles photos, please save all files from folder: --components/com_vehiclemanager/photos--!</li> <li>For save all Vehicles eDocuments, please save all files from folder what you set in  setting backent --Locatie of edocuments--!</li>\\n</ul>'),(2908,367,5,'\\n<strong>CSV&nbsp;EXPORT:</strong>\\n<ul> <li>CSV export will contain all velden for further editing in a text editor or spreadsheet application</li> <li>Please note that for subsequent import, only the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Omschrijving&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Voertuig type&nbsp;|&nbsp;Lijst type&nbsp;|&nbsp;Prijs&nbsp;|&nbsp;Prijs type&nbsp;|&nbsp;Vehicle Titel&nbsp;|&nbsp;...&nbsp;|</li> <li>You can also import later including Vehicle Beoordelingen, use FULL export instead!</li>\\n<li><strong>PAS OP:</strong>&nbsp;samband mellan husen kommer inte att sparas!</li>\n        <li><strong>PAS OP:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li></ul>\\n<strong>XML&nbsp;EXPORT:</strong>\\n<ul> <li>XML export is the preferred way to export vehicles with Vehicle Omschrijvings</li> <li>XML export will contain all vehicle details, including Omschrijvings, ready for later import</li>\\n</ul>\\n<strong>FULL&nbsp;DATA&nbsp;EXPORT:</strong>\\n<ul> <li>This export will export all VoertuigManager data and save all velden and entries</li> <li>You can later use these files to restore your VoertuigManager data in full</li> <li>This subsequent import will overwrite ALL existing entries, so be careful when using it!</li> <li>To restore all vehicle photos, please restore all files from folder: --components/com_vehiclemanager/photos--!</li> <li>To restore all vehicle eDocuments, please restore all files from the folder you have set in [Settings Backend] -- [Locatie of edocuments]</li>\\n</ul>'),(2909,368,5,'Verstuur Beoordeling Notificatie'),(2910,369,5,'Verstuur Beoordeling Notificatie'),(2911,370,5,'Zet op JA indien u een notificatie e-mail wilt ontvangen zodra een gebruiker een Voertuig Beoordeling toevoegt. U kunt meerdere adressen toevoegen [ Configuratie Backend ].'),(2912,371,5,'Gebruikersgroepen waaruit Beoordeling notificaties worden verzonde