/>- for CSV export to work, you need to compile PHP5 with XSL support<br/ >- for CAPTCHA to work, you need to compile PHP5 with GD support<br /><br />On the website <a href=\\\"http://www.ordasoft.com\\\">www.ordasoft.com</a> you can find VehicleManager Manuals, additional Language files, Support Forums and also download additional modules and plugins.<br /><br />We are available for Custom Development if you want a new feature added to VehicleManager. Please mail your exact requirements to <a href=\\\"mailto:sales@ordasoft.com\\\">sales@ordasoft.com</a> and we will get back to you with a quote. When you order a paid Customisation, you will receive the next PRO version with your custom feature added.'),(3674,286,6,'The fields below only need to be filled in manually when you have set '),(3675,287,6,'. otherwise they will be ignored.'),(3676,288,6,'Rent Request'),(3677,289,6,'The list shows the vehicles selected for renting.<br />If it is empty, please check your selection again.'),(3678,290,6,'Your full name'),(3679,291,6,'email'),(3680,292,6,'Your postal mailing address'),(3681,293,6,'Vehicle return date'),(3682,294,6,'Rent from'),(3683,295,6,'Your Rent Request was stored in our database. We will check your request and inform you as soon as possible.<br />Thank you for using our service.'),(3684,296,6,'Your Buying Request was stored in our database. We will check your request and inform you as soon as possible.<br />Thank you for using our service.'),(3685,297,6,'Your Suggestion was stored in our database.<br />Thank you for using our service.'),(3686,298,6,'VehicleManager: Rent Request accepted'),(3687,299,6,'The vehicle'),(3688,300,6,'you requested is ready to be rent out.'),(3689,301,6,'Save'),(3690,302,6,'Rent vehicle'),(3691,303,6,'Return vehicle from rent'),(3692,304,6,'Accept request'),(3693,305,6,'Decline request'),(3694,306,6,'Import vehicles'),(3695,307,6,'Export vehicles'),(3696,308,6,'Delete review'),(3697,309,6,'Edit review'),(3698,310,6,'General information:'),(3699,311,6,'Version:'),(3700,312,6,'Release date:'),(3701,313,6,'Project link:'),(3702,314,6,'Project host:'),(3703,315,6,'License:'),(3704,316,6,'This program is distributed in the hope that it will be useful, but without any warranty. See the included LICENSE.TXT for more details.'),(3705,317,6,'Developed by:'),(3706,318,6,'Homepage'),(3707,319,6,'edocument Download Link URL'),(3708,320,6,'Allow edocuments download'),(3709,321,6,'Allow edocuments download in the frontend. This function will only be activated if --Show edocuments Download Link-- is also set to YES'),(3710,322,6,'Allow edocuments download'),(3711,323,6,'Allow price:'),(3712,324,6,'Allow price in the frontend. This function will be activated only if --Show Price-- is also set to YES!'),(3713,325,6,'Allow price'),(3714,326,6,'VehicleManager :: Reviews'),(3715,327,6,'Vehicle title'),(3716,328,6,'Review title'),(3717,329,6,'Type the characters you see in the picture above into the box below.'),(3718,330,6,'Print'),(3719,331,6,'Please select the columns for printing and then click [ Next ]!'),(3720,332,6,'Font size'),(3721,333,6,'Format'),(3722,334,6,'Show edocument download license'),(3723,335,6,'Show edocument download license accept/decline before allowing edocument download from the frontend'),(3724,336,6,'Show edocument download license'),(3725,337,6,'License Agreement'),(3726,338,6,'Accept?'),(3727,339,6,'[ Add review ]'),(3728,340,6,'[ Hide review ]'),(3729,341,6,'[ Suggest Vehicle ]'),(3730,342,6,'Vehicle Suggestion'),(3731,343,6,'Suggestion Title'),(3732,344,6,'Suggestion Comment'),(3733,345,6,'Please enter a Title for your suggestion!'),(3734,346,6,'Please enter a Text for your suggestion!'),(3735,347,6,'VehicleManager :: Suggestions'),(3736,348,6,'Delete suggestion'),(3737,349,6,'View suggestion'),(3738,350,6,'Show button [ Buy now ]'),(3739,351,6,'Show button [ Buy now ]'),(3740,352,6,'Shows button [ Buy now ] next to the vehicle in the frontend'),(3741,353,6,'Allow button [ Buy now ]:'),(3742,354,6,'Show button [ Buy now ] in the frontend for the selected categories. This function will be activated only if --Show button [ Buy now ]-- is also set to YES! You can select multiple categories.'),(3743,355,6,'Allow button [ Buy now ]'),(3744,356,6,'Full data export'),(3745,357,6,'Full data import'),(3746,358,6,'This operation will remove ALL existing VehicleManager data before importing. Do you want to continue?'),(3747,359,6,'[ Hide suggestion ]'),(3748,360,6,'Show button<br />[ Suggest Vehicle ]'),(3749,361,6,'Show button<br />[ Suggest Vehicle ]'),(3750,362,6,'Shows button [ Suggest Vehicle ] in the vehicle list and vehicle details in the frontend'),(3751,363,6,'Allow button<br />[ Suggest Vehicle ]'),(3752,364,6,'Allow button<br />[ Suggest Vehicle ]'),(3753,365,6,'Allow button [ Suggest Vehicle ] in the frontend. This function will be activated only if --Show button [ Suggest Vehicle ]-- is also set to YES!'),(3754,366,6,'<strong>CSV&nbsp;IMPORT:</strong><ul>	<li>At the moment the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>	<li>Fields are separated by a pipe character (<strong>&nbsp;|&nbsp;</strong>)</li>	<li>You can import a whole list with just VehicleID by leaving the other fields empty, for example:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Price&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;...&nbsp;|</li>	<li><strong>WARNING:</strong>&nbsp;do not use CSV import if there are Vehicle Reviews present, in that case use full data import!</li></ul><strong>XML&nbsp;IMPORT:</strong><ul>	<li>import in XML </li>	<li><strong>WARNING:</strong>&nbsp;do not use XML import if there are Vehicle Reviews present, in that case use full data import!</li><li><strong>WARNING:</strong>&nbsp;associations between houses will not be saved!</li>\n        <li><strong>WARNING:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li></ul><strong>FULL&nbsp;DATA&nbsp;IMPORT:</strong><ul>	<li>This import will import all VehicleManager data and restore all fields and details</li>	<li>This option will overwrite ALL existing entries, so be careful when using it!</li>	<li>For save all Vehicles photos, please save all files from folder: --components/com_vehiclemanager/photos--!</li>	<li>For save all Vehicles eDocuments, please save all files from folder what you set in  setting backent --Location of edocuments--!</li></ul>'),(3755,367,6,'<strong>CSV&nbsp;EXPORT:</strong><ul>	<li>CSV export will contain all fields for further editing in a text editor or spreadsheet application</li>	<li>Please note that for subsequent import, only the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>	<li>You can also import later including Vehicle Reviews, use FULL export instead!</li><li></ul><strong>XML&nbsp;EXPORT:</strong><ul>	<li>XML export is the preferred way to export vehicles with Vehicle Descriptions</li>	<li>XML export will contain all vehicle details, including Descriptions, ready for later import</li><strong>WARNING:</strong>&nbsp;associations between houses will not be saved!</li>\n        <li><strong>WARNING:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li></ul><strong>FULL&nbsp;DATA&nbsp;EXPORT:</strong><ul>	<li>This export will export all VehicleManager data and save all fields and entries</li>	<li>You can later use these files to restore your VehicleManager data in full</li>	<li>This subsequent import will overwrite ALL existing entries, so be careful when using it!</li>	<li>To restore all vehicle photos, please restore all files from folder: --components/com_vehiclemanager/photos--!</li>	<li>To restore all vehicle eDocuments, please restore all files from the folder you have set in [Settings Backend] -- [Location of edocuments]</li></ul>'),(3756,368,6,'Send Review Notification'),(3757,369,6,'Send Review Notification'),(3758,370,6,'Set to YES if you want to be notified through email when a user adds a Vehicle Review. Use the panel on the right to set who will send these notifications. You can set the receiving email addresses in [ Configuration Backend ].'),(3759,371,6,'User groups from which Review notifications will be sent'),(3760,372,6,'User groups from which Review notifications will be sent'),(3761,373,6,'Choose which user groups will send Review notifications. This function will be activated only if --Send Review Notification-- is also set to YES'),(3762,374,6,'Send Suggestion Notification'),(3763,375,6,'Send Suggestion Notification'),(3764,376,6,'Set to YES if you want to be notified through email when a user adds a Vehicle Suggestion. Use the panel on the right to set who will send these notifications. You can set the receiving email addresses in [ Configuration Backend ].'),(3765,377,6,'User groups from which Suggestion notifications will be sent'),(3766,378,6,'User groups from which Suggestion notifications will be sent'),(3767,379,6,'Choose which user groups will send Suggestion notifications. This function will be activated only if --Send Suggestion Notification-- is also set to YES'),(3768,380,6,'Send Rent Request  Notification'),(3769,381,6,'Send Rent Request  Notification'),(3770,382,6,'Set to YES if you want to be notified through email when a user submits a Rent Request. Use the panel on the right to set who will send these notifications. You can set the receiving email addresses in [ Configuration Backend ].'),(3771,383,6,'User groups from which Rent Request notifications will be sent'),(3772,384,6,'User groups f