\\r\\n<strong>CSV&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>CSV L`exportation contiendra tous les champs pour une nouvelle rdaction dans un diteur de texte ou une application</li>\\r\\n	<li>Notez s`il vous plat que pour l`importation ultrieure, seulement le format de CSV suivant est support:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Type d`annonce&nbsp;|&nbsp;Prix&nbsp;|&nbsp;Prix type&nbsp;|&nbsp;Vhicule Titre&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li>Vous pouvez aussi importer plus tard des avis de Vhicule utiliser l`exportation COMPLTE de prfrence!</li>\\r\\n  <li><strong>AVERTISSEMENT:</strong>&nbsp;associations entre les maisons ne seront pas enregistres!</li>\n        <li><strong>AVERTISSEMENT:</strong>&nbsp;vous devez tlcharger les images une par, pas de photos seront sauvs!</li></ul>\\r\\n<strong>XML&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>XML L`exportation est la faon prfre d`exporter des vhicules avec des Descriptions de Vhicule</li>\\r\\n	<li>XML L`exportation contiendra tous les dtails de vhicule, y compris des Descriptions, prtes pou une importation ultrieur</li>\\r\\n</ul>\\r\\n<strong>FULL&nbsp;DATA&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>Cette exportation exportera toutes les donnes VehicleManager et sauvegadera tous les champs et entres</li>\\r\\n	<li>Vous pouvez plus tard utiliser ces fichiers pour rtablir vos donnes VehicleManager compltement</li>\\r\\n	<li>Cette importation ultrieure crasera TOUTES les entres existantes, soyer prudente en l`utilisant!</li>\\r\\n	<li>Pour rtablir toutes les photos de vhicule, rtablissez s`il vous plat tous les fichiers du dossier: --components/com_vehiclemanager/photos--!</li>\\r\\n	<li>Pour rtablir tout le vhicule eDocuments, rtablissez s`il vous plat tous les fichiers du dossier dont vous avez paramtr [Paramtres Backend] -- [Location of edocuments]</li>\\r\\n</ul>'),(5450,368,8,'Envoyez Notification d`avis'),(5451,369,8,'Envoyez Notificat