tionsapplication beinhalten</li>\\n	<li>Bitte nehmen Sie zur Kenntnis, dass fr einen darauffolgenden Import, nur das folgende CSV-Format untersttzt wird:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Sie knnen auch spter zugehrige Fahrzeugbewertungen importieren, anstatt einen VOLLSTNDIGEN Export durchzufhren!</li>\\n<li><strong>WARNING:</strong>&nbsp;Assoziationen zwischen den Husern werden nicht gespeichert!</li>\n        <li><strong>WARNING:</strong>&nbsp;Sie Bilder einzeln hochzuladen, werden keine Bilder gespeichert werden!</li></ul>\\n<strong>XML&nbsp;EXPORT:</strong>\\n<ul>\\n	<li>XML Export ist der bevorzugte Weg, um Fahrzeuge mit Fahrzeugbeschreibungen zu exportieren.</li>\\n	<li>XML Export beinhaltet alle Fahrzeugdetails, einschlielich Beschreibungen, welche fr einen spteren Import zur Verfgung stehen.</li>\\n</ul>\\n<strong>VOLLSTNDIGER&nbsp;DATEN&nbsp;EXPORT:</strong>\\n<ul>\\n	<li>Dieser Export wird alle VehicleManager Daten exportieren und speichert alle Felder und Eintrge.</li>\\n	<li>Diese Dateien knnen Sie spter benutzen, um Ihre VehicleManager-Daten vollstndig wiederherzustellen.</li>\\n	<li>Dieser darauffolgende Import wird ALLE existierenden Eintrge berschreiben, deshalb seien Sie vorsichtig, wenn Sie diesen Import benutzen!</li>\\n	<li>Um alle Fahrzeugbilder wiederherzustellen, stellen Sie bitte alle Datein im Ordner: --components/com_vehiclemanager/photos-- wieder her!</li>\\n	<li>Um die Fahrzeug E-Dokumente wiederherzustellen, stellen Sie bitte alle Dateien im Ordner, welche Sie in [Einstellungen Backend] -- [Speicherort von E-Dokumente] gesetzt haben, wieder her.</li>\\n</ul>'),(6297,368,9,'Bewertungszustellung senden'),(6298,369,9,'Bewertungszustellung senden'),(6299,370,9,'Setze nach JA, wenn Sie per E-Mail benachrichtigt werden wollen, wenn ein Benutzer ein