nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>A mezket cs karakterrel kell elvlasztani (<strong>&nbsp;|&nbsp;</strong>)</li>\\n	<li>Teljes lista importlsa res mezkkel plda:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Price&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li><strong>FIGYELMEZTETS:</strong>&nbsp;ne hasznljon CSV-t, ha a jrmnl vlemnyek vannak! Ez esetben hasznljon teljes adat importot!</li>\\n</ul>\\n<strong>XML&nbsp;IMPORT:</strong>\\n<ul>\\n	<li>Import XML formtumban</li>\\n	<li><strong>FIGYELMEZTETS:</strong>&nbsp;ne hasznljon XML-t, ha a jrmnl vlemnyek vannak! Ez esetben hasznljon teljes adat importot!</li>\\n<li><strong>WARNING:</strong>&nbsp;associations between houses will not be saved!</li>\n        <li><strong>WARNING:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li></ul>\\n<strong>TELJES&nbsp;ADAT&nbsp;IMPORT:</strong>\\n<ul>\\n	<li>Ez az import teljesen lecserli a jrmkezel adatait minden terleten s rszletben.</li>\\n	<li>Ez az opci fellrja a mr meglv bejegyzseket, ezrt legyen krltekint a hasznlatakor!</li>\\n	<li>Ha szeretn megmenteni a jrm kpeket, mentse az albbi knyvtr tartalmt: --components/com_vehiclemanager/photos--!</li>\\n	<li>Ha szeretn megmenteni a jrm E-dokumentumokat, mentse azt a knyvtrat, amit meghatrozott az E-dokumentumok helyeknt!</li>\\n</ul>'),(7143,367,10,'\\n<strong>CSV&nbsp;EXPORT:</strong>\\n<ul>\\n	<li>A CSV export tartalmaz minden mezt, s szerkeszthet egyszer szvegszerkesztvel, vagy tblzatkezel alkalmazssal.</li>\\n	<li>Krjk, vegye figyelembe, hogy az adatok ksbbi importjnl a kvetkez CSV formtum tmogatott:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Akkor is ha ksbb csak jrm vlemnyeket hasznl, hasznlja a teljes adat exportot!</li>\\n</ul>\\n<strong>XML&nbsp;EXPORT:</strong>\\n<ul>\\n	<li>Az XML export az elnyben rszestett t a jrm s a jrmadatok exportlshoz!</li>\\n	<li>Az XML export mindent tartalmaz egy ksbbi importhoz!</li>\\n<li><strong>WARNING:</strong>&nbsp;associations between houses will not be saved!</li>\n        <li><strong>WARNING:</strong>&nbsp;you have to upload images singly, no photos will be saved!</li></ul>\\n<strong>TELJES&nbsp;ADAT&nbsp;EXPORT:</strong>\\n<ul>\\n	<li>Ez az export minden adatot elment.</li>\\n	<li>Ksbb ebbl minden adatot vissza tud lltani.</li>\\n	<li>Ez a ksbbi import fellrja a mr meglv adatokat, ezrt legyen krltekint, amikor hasznlja!</li>\\n	<li>Ha szeretn megmenteni a jrm kpeket, mentse az albbi knyvtr tartalmt: --components/com_vehiclemanager/photos--!</li>\\n	<li>Ha szeretn megmenteni a jrm E-dokumentumokat, mentse azt a knyvtrat, amit meghatrozott az E-dokumentumok helyeknt!</li>\\n</ul>'),(7144,368,10,'Vlemny rtest kldse'),(7145,369,10,'Vlemny rtest kldse'),(7146,370,10,'lltsa Igen-re ha szeretne rteslni, ha egy felhasznl vlemnyt fz egy jrmhz. Hasznlja az engedlyezst az rtestsek kikldshez. Az adminisztrcis fellet belltsainl tudja belltani a fogad E-mail cmeket.'),(7147,371,10,'Felhasznli csoportok, amiknl rtestst kldjn.'),(7148,372,10,'Felhasznli csoportok, amiknl rtestst kldjn.'),(7149,373,10,'Vlassza ki, hogy mely felhasznli csoport vlemnyezsnl kldjn rtestst. Ez a funkci akkor aktivldik, ha a --Vlemny rtest kldse-- IGEN-re van lltva!'),(7150,374,10,'Ajnlat rtest kldse'),(7151,375,10,'Ajnlat rtest kldse'),(7152,376,10,'lltsa Igen-re ha szeretne rteslni, ha egy felhasznl ajnlatot fz egy jrmhz. Hasznlja az engedlyezst az rtestsek kikldshez. Az adminisztrcis fellet belltsainl tudja belltani a fogad E-mail cmeket.'),(7153,377,10,'Felhasznli csoportok, amiknl rtestst kldjn.'),(7154,378,10,'Felhasznli csoportok, 