mento Digitale'),(7959,337,11,'Licenza'),(7960,338,11,'Accetti?'),(7961,339,11,'Aggiungi Recensione'),(7962,340,11,'Nascondi Recensione'),(7963,341,11,'Proponi Veicolo'),(7964,342,11,'Proponi Veicolo'),(7965,343,11,'Titolo Proposta'),(7966,344,11,'Commento Proposta'),(7967,345,11,'Si prega di inserire un titolo per la Proposta!'),(7968,346,11,'Inserisci un testo per la Proposta!'),(7969,347,11,'Gestione Veicoli :: Proposte'),(7970,348,11,'Cancella la Proposta'),(7971,349,11,'Mostra Proposta'),(7972,350,11,'Mostra pulsante [Acquista]'),(7973,351,11,'Mostra pulsante [Acquista]'),(7974,352,11,'Mostra pulsante [Acquista ora] accanto al veicolo lato utente'),(7975,353,11,'Consenti tasto [Acquista]:'),(7976,354,11,'Mostra pulsante [Acquista] lato utente per le categorie selezionate. Questa funzione sar attivata solo se - Mostra Pulsante  [Acquista] -  impostato su Si!  possibile selezionare pi categorie.'),(7977,355,11,'Consenti tasto [Acquista]'),(7978,356,11,'Esporta dati completi'),(7979,357,11,'Importa dati completi'),(7980,358,11,'Questa operazione cancella TUTTI i dati esistenti in Gestione Veicoli prima di importare. Vuoi continuare?'),(7981,359,11,'Nascondi Proposta'),(7982,360,11,'<br /> Mostra Pulsante [Proponi Veicolo]'),(7983,361,11,'<br /> Mostra Pulsante [Proponi Veicolo]'),(7984,362,11,'Mostra pulsante [Proponi Veicolo] nella lista dei veicoli e maggiori dettagli sul veicolo lato utente'),(7985,363,11,'Consenti <br /> tasto [Proponi Veicolo]'),(7986,364,11,'Consenti <br /> tasto [Proponi Veicolo]'),(7987,365,11,'Consenti tasto [Proponi Veicolo] lato utente. Questa funzione sar attivata solo se - Mostra Pulsante [Proponi Vicolo] -  impostato su SI!'),(7988,366,11,'\\n<strong> IMPOSRTAZIONE CSV: </strong>\\n<ul>\\n	<li> Al momento &grave; supportato il seguente formato CSV::&nbsp;:&nbsp;ID Veicolo:&nbsp;|:&nbsp;Descrizione:&nbsp;|:&nbsp;Link:&nbsp;|:&nbsp;Modello:&nbsp;|:&nbsp;Tipo di veicolo:&nbsp;|:&nbsp;Tipo di Inserzione:&nbsp;|:&nbsp;Prezzo:&nbsp;|:&nbsp;Tipo Prezzo:&nbsp;|Titolo Veicolo | ... | </li>\\n	<li> I campi sono separati da un carattere pipe (<strong> | </ strong>) </li>\\n	<li>  possibile importare un intero elenco con solo ID Veicolo lasciando gli altri campi vuoti, per esempio:&nbsp;&nbsp;ID Veicolo&nbsp;|&nbsp;<i> vuoto </i>&nbsp;|&nbsp;<i> vuoto </i>&nbsp;|&nbsp;Attori&nbsp;|&nbsp;<i> vuoto </i>&nbsp;|&nbsp;<i> vuoto </i>&nbsp;|&nbsp;Prezzo&nbsp;|&nbsp;<i> vuoto </i >&nbsp;| ... |&nbsp;</li>\\n	<li> <strong> ATTENZIONE: </strong> non utilizzare l\'importazione CSV se sono presenti Recensioni veicoli, in questo caso utilizzare Importazione dati completa! </li>\\n</ul>\\n<strong> IMPORTAZIONE XML: </strong>\\n<ul>\\n<li> importazione in formato XML</li>\\n<li> <strong> ATTENZIONE: </strong> non utilizzare l\'importazione XML se sono presenti Recensioni veicoli, in questo caso utilizzare Importazione dati Completa! </li>\\n<li><strong>ATTENZIONE:</strong>&nbsp;non verranno salvate le associazioni tra le case!</li>\n        <li><strong>ATTENZIONE:</strong>&nbsp;devi caricare le immagini singolarmente, verranno salvati nessuna foto!</li></ul>\\n<strong> IMPORTAZIONE DATI COMPLETA: </strong>\\n<ul>\\n<li> Questa importazione consente di importare tutti i dati Gestione Veicoli e ripristinare tutti i campi e dettagli </li>\\n<li> Questa opzione sovrascrive tutte le voci esistenti, quindi state attenti quando lo si usa! </li>\\n<li> Per salvare tutte le foto veicoli, si prega di salvare tutti i file dalla cartella: --components/com_vehiclemanager/photos--! </li>\\n<li> Per salvare tutti i Documenti Digitali dei veicoli, si prega di salvare tutti i file dalla cartella definita nelle impostazioni lato amministratore - Posizione Document'),(7989,367,11,'\\n<strong> ESPORTAZIONE CSV: </ strong>\\n<ul>\\n<li> Il file CSV esportato conterr tutti i campi per ulteriore modifica in un editor di testo o in un foglio di calcolo </li>\\n<li> Si prega di notare che per la successiva importazione, supportato solo il formato CSV seguente: IDVeicolo | Descrizione | Link | Modello | Tipo di veicolo | Tipo di inserzione | Prezzo | Tipo Prezzo | Titolo Veicolo | ... | </li>\\n<li>  inoltre possibile importare successivamente anche le Recensioni Veicolo, usando invece Esposrtazione Completa Dati </li>\\n</ul>\\n<strong> ESPORTAZIONE XML: </strong>\\n<ul>\\n<li> Esportazione XML  il modo migliore per esportare i veicoli con le sue descrizioni </li>\\n<li> Il file XML esportato conterr tutti i dettagli del veicolo, incluse le descrizioni, pronto per l importazione successiva </li>\\n<li><strong>ATTENZIONE:</strong>&nbsp;non verranno salvate le associazioni tra le case!</li>\n        <li><strong>ATTENZIONE:</strong>&nbsp;devi caricare le immagini singolarmente, verranno salvati nessuna foto!</li></ul>\\n<strong> ESPORTAZIONE COMPLETA DATI: </strong>\\n<ul>\\n<li> Questa esportazione salva tutti i dati di Gestione Veicoli con tutti i campi e le voci </li>\\n<li> In seguito,  possibile utilizzare questi file per ripristinare completamente i dati di Gestione Veicoli </li>\\n<li> La reimportazione successivasovrascriver tutte le voci esistenti, quindi state attenti quando lo si usa! </li>\\n<li> Per ripristinare tutte le foto del veicolo, si prega di ripristinare tutti i file dalla cartella: --components/com_vehiclemanager/photos--! </li>\\n<li> Per ripristinare tutti i Documenti Digitali del veicolo, si prega di ripristinare tutti i file dalla cartella definita nelle impostazioni lato amministratore - [Posizione Documenti Digitali] </li>\\n</ul>'),(7990,368,11,'Invia Notifica Recensione'),(7991,369,11,'Invia Notifica Recensione'),(7992,370,11,'SI se si vuole ricevere notifica tramite e-mail quando un utente aggiunge una recensione del veicolo. Utilizza il pannello a destra per impostare chi invier le notifiche.  possibile impostare gli indirizzi email che ricevono le notifiche in [Configurazione Amministrazione].'),(7993,371,11,'Gruppi di utenti da cui saranno inviate le notifiche di recensione'