&nbsp;</strong>)</li>\\n	<li>Js galite atlikti viso srao import kartu su Automobilio ID, palikdami kitus laukus tuius, pavyzdiui:&nbsp;&nbsp;Automobilio ID&nbsp;|&nbsp;<i>tuia</i>&nbsp;|&nbsp;<i>tuia</i>&nbsp;|&nbsp;Modelis&nbsp;|&nbsp;<i>tuia</i>&nbsp;|&nbsp;<i>tuia</i>&nbsp;|&nbsp;Kaina&nbsp;|&nbsp;<i>tuia</i>&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li><strong>SPJIMAS:</strong>&nbsp;nedarykite CSV importo, jeigu sistemoje egzistuoja Automobili Apvalgos. Tokiu atveju geriau atlikite piln duomen import!</li>\\n</ul>\\n<strong>XML&nbsp;IMPORTUOTI:</strong>\\n<ul>\\n	<li>importas XML formatu</li>\\n	<li><strong>SPJIMAS:</strong>&nbsp;nedarykite XML importo, jeigu sistemoje egzistuoja Automobili Apvalgos. Tokiu atveju geriau atlikite piln duomen import!</li>\\n<li> <stiprus> DMESIO!: </ strong>, & nbsp; asociacijos tarp nam nebus isaugotas </ li>\n<li> <stiprus> DMESIO: </ strong>, & nbsp; turite kelti nuotraukas atskirai, nra nuotraukos, bus igelbtas \"</ li>! </ul>\\n<strong>PILNAS&nbsp;DUOMEN&nbsp;IMPORTAS:</strong>\\n<ul>\\n	<li>Importuos visus Vehicle Manager duomenis ir atkurs visus duomen laukus bei raus!</li>\\n	<li>Importuojant duomenis, visi raai bus perrayti. Bkite atsargs!</li>\\n	<li>Nordami isaugoti visas transporto priemoni nuotraukas, btinai isaugokite visus failus, esanius kataloge: --components/com_vehiclemanager/photos--!</li>\\n	<li>Nordami isaugoti visus Automobili edokumentus, praome isaugoti vis aplank, kur js prie tai buvote nustat --edokument buvimo vieta--!</li>\\n</ul>'),(8836,367,12,'\\n<strong>CSV&nbsp;EKSPORTAS:</strong>\\n<ul>\\n	<li>CSV eksportas turs vis reikiam standartini lauk struktr, kuri bus galima toliau redaguoti su kitomis programomis ir skaiiuoklmis</li>\\n	<li>Atkreipkite dmes, kad po CSV importo susidarys tokie duomen laukai:&nbsp;&nbsp;Automobilio ID&nbsp;|&nbsp;Apraymas&nbsp;|&nbsp;Nuoroda&nbsp;|&nbsp;Modelis&nbsp;|&nbsp;Automobilio tipas&nbsp;|&nbsp;Srao tipas&nbsp;|&nbsp;Kaina&nbsp;|&nbsp;Kainos tipas&nbsp;|&nbsp;Automobilio pavadinimas&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Reikalui esant, import galite atlikti vliau,  kur taip pat eis ir Automobilio Apvalgos!</li>\\n</ul>\\n<strong>XML&nbsp;EKSPORTAS:</strong>\\n<ul>\\n	<li>XML eksporto bdas yra priimtiniausias, jei norite eksportuoti automobilius kartu su j apraymais</li>\\n	<li>XML eksporto metu, isisaugos visi transporto priemoni duomenys, skaitant automobili apraymus, o taip pat su galimybe parengti import vliau</li>\\n<li> <stiprus> DMESIO!: </ strong>, & nbsp; asociacijos tarp nam nebus isaugotas </ li>\n<li> <stiprus> DMESIO: </ strong>, & nbsp; turite kelti nuotraukas atskirai, nra nuotraukos, bus igelbtas \"</ li>! </ul>\\n<strong>PILNAS&nbsp;DUOMEN&nbsp;EKSPORTAS:</strong>\\n<ul>\\n	<li>Eksportuos visus Vehicle Manager duomenis ir isaugos visus duomen laukus bei raus</li>\\n	<li>Js galite vliau panaudoti iuos failus, nordami pilnai atkurti VehicleManager duomenis</li>\\n	<li>Importuojant duomenis, visi raai bus perrayti. Bkite atsargs!</li>\\n	<li>Nordami atkurti visas automobili nuotraukas, praome atstatyti visas bylas, kurios yra iame kataloge: --components/com_vehiclemanager/photos--!</li>\\n	<li>Nordami atkurti visus Automobili edokumentus, praome atstatyti visas bylas, i to katalogo, kur buvote nustat [valdymo nustatymai] -- [edokument buvimo vieta]</li>\\n</ul>'),(8837,368,12,'Sisti apvalgos praneim'),(8838,369,12,'Sisti apvalgos praneim'),(8839,370,12,'Paymkite TAIP, jei norite gauti praneim elektroniu patu, kai lankytojas upildo Automobilio Apvalg. Valdymo pulte deinje pusje nustatykite kas turs isisti iuos praneimus. Taip pat galite nustatyti atgalin elektronio pato adres [ Valdymo konfigracija ].'),(8840,371,12,'Vartotoj grups, kurios sis praneimus'),(8841,372,12,'Vartotoj grups, kurios sis praneimus'),(8842,373,12,'Pasirinkite, kurios vartotoj grups sis apvalgas. i funkcija bus galima, jei aktyvuosite --Sisti Periros Praneimus-- ir nustatysite TAIP'),(8843,374,12,'Sisti pasilym'),(8844,375,12,'Sisti pasilym'),(8845,376,12