\n<br />\\r\\nOn the website <a href=\\\"http://www.ordasoft.com\\\">www.ordasoft.com</a> you can find VehicleManager Manuals, additional Language files, Support Forums and also download additional modules and plugins.<br />\\r\\n<br />\\r\\nWe are available for Custom Development if you want a new feature added to VehicleManager. Please mail your exact requirements to <a href=\\\"mailto:sales@ordasoft.com\\\">sales@ordasoft.com</a> and we will get back to you with a quote. When you order a paid Customisation, you will receive the next PRO version with your custom feature added.'),(9602,286,13,'The fields below only need to be filled in manually when you have set '),(9603,287,13,'. otherwise they will be ignored.'),(9604,288,13,'Leieforesprsel'),(9605,289,13,'Listen viser kjrety valgt for utleie.<br />Dersom listen er tom, sjekk valgene dine p nytt.'),(9606,290,13,'Fullt navn'),(9607,291,13,'epost'),(9608,292,13,'Din postadresse'),(9609,293,13,'Returdato for leie.'),(9610,294,13,'Leie fra'),(9611,295,13,'Din foresprsel er lagret i vr database. Vi kommer tilbake med et svar s fort som mulig..<br />Takk for at du benytter vr tjeneste.'),(9612,296,13,'Din foresprsel om kjp er lagret, vi kommer tilbake med et svar s fort som mulig.<br />Takk for at du benytter vr tjeneste'),(9613,297,13,'Your Suggestion was stored in our database.<br />Takk for at du benytter vr tjeneste.'),(9614,298,13,'VehicleManager: Leieforesprselen er akseptert'),(9615,299,13,'Kjretyet'),(9616,300,13,'kjretyet du nsket er allereder utleid.'),(9617,301,13,'Lagre'),(9618,302,13,'Lei kjrety'),(9619,303,13,'Retur av utleid kjrety'),(9620,304,13,'Godkjenn foresprsel'),(9621,305,13,'Avvis foresprsel'),(9622,306,13,'Importer kjrety'),(9623,307,13,'Eksporter kjrety'),(9624,308,13,'Slett anmeldelse'),(9625,309,13,'Rediger anmeldelse'),(9626,310,13,'Generell informasjon:'),(9627,311,13,'Versjon:'),(9628,312,13,'Utgivelsesdato:'),(9629,313,13,'Prosjektlink:'),(9630,314,13,'Prosjektvert:'),(9631,315,13,'Lisens:'),(9632,316,13,'This program is distributed in the hope that it will be useful, but without any warranty. See the included LICENSE.TXT for more details.'),(9633,317,13,'Utviklet av:'),(9634,318,13,'Hjemmeside'),(9635,319,13,'URL til edocumentets nedlastingslink'),(9636,320,13,'Tillat nedlasting av edocuments'),(9637,321,13,'Tillat nedlasting av edocuments i frontend. Funksjonen krever at --Vis link til nedlasting av edokument-- ogs settes til JA'),(9638,322,13,'Tillat edocuments nedlasting'),(9639,323,13,'Tillat pris:'),(9640,324,13,'Tillat pris i frontend. Funksjonen krever at--Vis pris-- ogs er satt til JA!'),(9641,325,13,'Tillat pris'),(9642,326,13,'VehicleManager :: Anmeldelser'),(9643,327,13,'Tittel p kjrety'),(9644,328,13,'Tittel p vurdering'),(9645,329,13,'Tast inn bokstaver og tall som vises i bildet ovenfor, i boksen under.'),(9646,330,13,'Skriv ut'),(9647,331,13,'Velg kolonner som skal skrives ut og velg [ Neste ]!'),(9648,332,13,'Font strrelse'),(9649,333,13,'Format'),(9650,334,13,'Vis edocumentets nedlastingslisens'),(9651,335,13,'Vis edocumentets nedlastingslisens godta/ikke godta fr edokumentet kan lastes ned i frontend.'),(9652,336,13,'Vis edocumentets nedlastingslisens'),(9653,337,13,'Lisense Agreement'),(9654,338,13,'Godta?'),(9655,339,13,'[ Legg til anmeldelse ]'),(9656,340,13,'[ Skjul anmeldelse ]'),(9657,341,13,'[ Forsl kjrety ]'),(9658,342,13,'Kjrety forslag'),(9659,343,13,'Forslagstittel'),(9660,344,13,'Kommetar til forslaget'),(9661,345,13,'Legg til en tittel for forslaget!'),(9662,346,13,'Legg til en tekst til forslaget ditt!'),(9663,347,13,'VehicleManager :: Forslag'),(9664,348,13,'Slett forslag'),(9665,349,13,'Vis forslag'),(9666,350,13,'Show button [ Kjp n ]'),(9667,351,13,'Vis knapp [ Kjp n ]'),(9668,352,13,'Vis knapp [ Kjp n ] ved siden av kjretyet i frontende'),(9669,353,13,'Tillat knappen [ Kjp n ]:'),(9670,354,13,'Vis knappen [ Kjp n ] i frontend for valgte kategorier. Funksjonen aktivereskun hvis --Vis knappen [ Kjp n ]-- ogs er satt til JA! Du kan velge flere kategorier.'),(9671,355,13,'Tillat knappen [ Kjp n ]'),(9672,356,13,'Full dataeksport'),(9673,357,13,'Full dataimport'),(9674,358,13,'Denne operasjonen sletter ALLE data fr import. Vil du fortsette?'),(9675,359,13,'[ Skjul forslag ]'),(9676,360,13,'Vis knappen<br />[ Foresl kjrety ]'),(9677,361,13,'Vis knappen<br />[ Foresl kjrety ]'),(9678,362,13,'Vis knappen [ Foresl kjrety ] i kjrety lista og detaljer i frontend'),(9679,363,13,'Tillat knappen<br />[ Foresl kjrety ]'),(9680,364,13,'Tillat knappen<br />[ Foresl kjrety ]'),(9681,365,13,'Tillat knappen [ Foresl kjrety ] i frontend. Denne funksjonen aktiveres kun hvis --Vis knappen [ Foresl kjrety ]-- ogs er satt til JA!'),(9682,366,13,'\\r\\n<strong>CSV&nbsp;IMPORT:</strong>\\r\\n<ul>\\r\\n	<li>At the moment the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li>Fields are separated by a pipe character (<strong>&nbsp;|&nbsp;</strong>)</li>\\r\\n	<li>You can import a whole list with just VehicleID by leaving the other fields empty, for example:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;Price&nbsp;|&nbsp;<i>empty</i>&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li><strong>WARNING:</strong>&nbsp;do not use CSV import if there are Vehicle Reviews present, in that case use full data import!</li>\\r\\n<li> <strong> ADVARSEL: </ strong> & nbsp; assosiasjoner mellom husene blir ikke lagret </ li>\n<li> <strong> ADVARSEL: </ strong> & nbsp; du m laste opp bilder enkeltvis, ingen bilder blir lagret </ li>!</ul>\\r\\n<strong>XML&nbsp;IMPORT:</strong>\\r\\n<ul>\\r\\n	<li>import in XML </li>\\r\\n	<li><strong>WARNING:</strong>&nbsp;do not use XML import if there are Vehicle Reviews present, in that case use full data import!</li>\\r\\n</ul>\\r\\n<strong>FULL&nbsp;DATA&nbsp;IMPORT:</strong>\\r\\n<ul>\\r\\n	<li>This import will import all VehicleManager data and restore all fields and details</li>\\r\\n	<li>This option will overwrite ALL existing entries, so be careful when using it!</li>\\r\\n	<li>For save all Vehicles photos, please save all files from folder: --components/com_vehiclemanager/photos--!</li>\\r\\n	<li>For save all Vehicles eDocuments, please save all files from folder what you set in  setting backent --Location of edocuments--!</li>\\r\\n</ul>'),(9683,367,13,'\\r\\n<strong>CSV&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>CSV export will contain all fields for further editing in a text editor or spreadsheet application</li>\\r\\n	<li>Please note that for subsequent import, only the following CSV format is supported:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\r\\n	<li>You can also import later including Vehicle Reviews, use FULL export instead!</li>\\r\\n<li> <strong> ADVARSEL: </ strong> & nbsp; assosiasjoner mellom husene blir ikke lagret </ li>\n<li> <strong> ADVARSEL: </ strong> & nbsp; du m laste opp bilder enkeltvis, ingen bilder blir lagret </ li>!</ul>\\r\\n<strong>XML&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>XML export is the preferred way to export vehicles with Vehicle Descriptions</li>\\r\\n	<li>XML export will contain all vehicle details, including Descriptions, ready for later import</li>\\r\\n</ul>\\r\\n<strong>FULL&nbsp;DATA&nbsp;EXPORT:</strong>\\r\\n<ul>\\r\\n	<li>This export will export all VehicleManager data and save all fields and entries</li>\\r\\n	<li>You can later use these files to restore your VehicleManager data in full</li>\\r\\n	<li>This subsequent import will overwrite ALL existing entries, so be careful when using it!</li>\\r\\n	<li>To restore all vehicle photos, please restore all files from folder: --components/com_vehiclemanager/photos--!</li>\\r\\n	<li>To restore all vehicle eDocuments, please restore all files from the folder you have set in [Settings Backend] -- [Location of edocuments]</li>\\r\\n</ul>'),(9684,368,13,'Send anmeldelsesnotis'),(9685,369,13,'Send anmeldelsesnotis'),(9686,370,13,'Set to YES if you want to be notified through email when a user adds a Vehicle Review. Use the panel on the right to set who will send these notifications. You can set the receiving email addresses in [ Configuration Backend ].'),(9687,371,13,'User groups from which Review notifications will be sent'),(9688,372,13,'User groups from which Review notifications will be sent'),(9689,373,13,'Choose which user groups will send Review notifications. This function will be activated only if --Send Review Notification-- is also set to YES'),(9690,374,13,'Send Suggestion Notification'),(9691,375,13,'Send Suggestion Notification'),(9692,376,13,'Set to YES if you want to be notified through email when a user adds a Vehicle Suggestion. Use the panel on the right to set who will send these notifications. You can set the receiving email addresses in [ Configuration Backend ].'),(9693,377,13,'User groups from which Suggestion notifications will be sent'),(9694,378,13,'User groups from which Suggestion notifications will be sent'),(9695,379,13,'Choose which user groups will send Suggestion notifications. This function will be activated only if --Send Suggestion Notification-- is also set to YES'),(9696,380,13,'Send Rent Request  Notification'),(9697,381,13,'Send Rent Request  Notification'),(9698,382,13,'Set to YES if you want to be notified through email when a user submits a Rent Request. Use the panel on the right to set who will send these notifications. You can set the receiving email addresses in [ Configuration Backend ].'),(9699,383,13,'User groups from which Rent Request notifications will be sent'),(97