azdw; w takim wypadku uywaj penego importu danych!</li>\\n<li><strong>UWAGA:</strong>&nbsp;nie zostan? zapisane stowarzyszenia mi?dzy domami!</li>\n        <li><strong>UWAGA:</strong>&nbsp;musisz przes?a? zdj?cia pojedynczo, zdj?cia b?d? zapisywane!</li></ul>\\n<strong>PENY&nbsp;IMPORT&nbsp;DANYCH:</strong>\\n<ul>\\n	<li>To importowanie zaimportuje wszystkie dane VehicleManagera i przywrci wszystkie pola oraz detale</li>\\n	<li>Ta opcja zastpi WSZYSTKIE wystpujce wpisy, wic zachowaj ostrono, gdy jej uywasz!</li>\\n	<li>Aby zapisa wszystkie zdjcia pojazdw, zapisz wszystkie pliki z folderu: --components/com_vehiclemanager/photos--!</li>\\n	<li>Aby zapisa wszystkie e-dokumenty pojazdw, zapisz wszystkie pliki z folderu sprecyzowanego w ustawieniach zaplecza: --Lokalizacja e-dokumentw--!</li>\\n</ul>'),(10530,367,14,'\\n<strong>CSV&nbsp;EKSPORT:</strong>\\n<ul>\\n	<li>Eksport CSV bdzie zawiera wszystkie pola do pniejszego wypenienia w edytorze tekstowym lub arkuszu kalkulacyjnym</li>\\n	<li>Pamitaj przy kolejnym imporcie, e tylko nastpujcy format CSV jest obsugiwany:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Moesz rwnie zaimportowa pniej, wliczajc recenzje pojazdw, uywajc PENEGO eksportu!</li>\\n</ul>\\n<strong>XML&nbsp;EKSPORT:</strong>\\n<ul>\\n	<li>Eksport XML jest preferowan metod eksportu pojazdw z opisami</li>\\n	<li>Eksport XML bdzie zawiera wszystkie detale pojazdu, wliczajc opisy, gotowe do pniejszego importu</li>\\n<li><strong>UWAGA:</strong>&nbsp;nie zostan? zapisane stowarzyszenia mi?dzy domami!</li>\n        <li><strong>UWAGA:</strong>&nbsp;musisz przes?a? zdj?cia pojedynczo, zdj?cia b?d? zapisywane!</li></ul>\\n<strong>PENY&nbsp;EKSPORT&nbsp;DANYCH:</strong>\\n<ul>\\n	<li>Ten eksport wyeksportuje wszystkie dane VehicleManagera i zapisze wszystkie pola oraz wpisy</li>\\n	<li>Moesz uy tych plikw pniej, aby przywrci w peni swoje dane VehicleManagera</li>\\n	<li>Kolejny import zastpi WSZYSTKIE wystpujce wpisy, wic zachowaj ostrono, gdy go uywasz!</li>\\n	<li>Aby przywrci wszystkie zdjcia pojazdw, przywr wszystkie pliki z folderu: --components/com_vehiclemanager/photos--!</li>\\n	<li>Aby przywrci wszystkie e-dokumenty pojazdw, przywr wszystkie pliki z folderu okrelonego w [Ustawienia zaplecza] -- [Lokalizacja e-dokumentw]</li>\\n</ul>'),(10531,368,14,'Wylij powiadomienie o recenzji'),(10532,369,14,'Wylij powiadomienie o recenzji'),(10533,370,14,'Ustaw na TAK, jeeli chcesz otrzymywa powiadomienia na e-mail, kiedy uytkownik doda recenzj pojazdu. Uyj panelu po prawej stronie, aby ustawi nadawc powiadomie. Moesz ustawi adresy odbiorcw w [ Konfiguracja zaplecza ].'),(10534,371,14,'Grupy uytkownikw, od ktrych bd wysyane powiadomienia o recenzji'),(10535,372,14,'Grupy uytkownikw, od ktrych bd wysyane powiadomienia o recenzji'),(10536,373,14,'Wybierz, ktre grupy uytkownikw bd wysya powiadomienia o recenzji. Ta funkcja bdzie aktywowowana, jeeli --Wysyaj powiadomienie o recenzji-- jest ustawione na TAK'),(10537,374,14,'Wylij powiadomienie o propozycji'),(10538,375,14,'Wylij powiadomienie o propozycji'),(10539,376,14,'Ustaw na TAK, jeeli chcesz otrzymywa powiadomienia na e-mail, kiedy uytkownik doda propozycj pojazdu. Uyj panelu po prawej stronie, aby ustawi nadawc powiadomie. Moesz ustawi adresy odbiorcw w [ Konfiguracja zaplecza ].'),(10540,377,14,'Grupy uytkownikw, od ktrych bd wysyane powiadomienia o propozycji'),(10541,378,14,'Grupy uytkownikw, od ktrych bd wysyane powiadomienia o propozycji'),(10542,379,14,'Wybierz, ktre grupy uytkownikw bd wysya powiadomienia o propozycji. Ta funkcja bdzie aktywowowana, jeeli --Wysyaj powiadomienie o propozycji-- jest ustawione na TAK'),(10543,380,14,'Wylij powiadomienie o zapytaniu o wypoyczenie'),(10544,381,14,'Wylij powiadomienie o zapytaniu o wypoyczenie'),(10545,382,14,'Ustaw na TAK, jeeli chcesz otrzy