o:&nbsp;&nbsp;ID do Veculo&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;Modelo&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;Preo&nbsp;|&nbsp;<i>vazio</i>&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li><strong>AVISO:</strong>&nbsp; no utilize importar CSV se houverem Revises de Veculos presentes, neste caso utilize a importao de dados completa!</li>\\n</ul>\\n<strong>XML&nbsp;IMPORTAR:</strong>\\n<ul>\\n	<li>importar em XML </li>\\n	<li><strong>AVISO:</strong>&nbsp; no utilize importar XML se houverem Revises de Veculos presentes, neste caso utilize a importao de dados completa!</li>\\n  <li><strong>AVISO:</strong>&nbsp;associaes entre as casas no sero salvos!</li>\n        <li><strong>AVISO:</strong>&nbsp;voc tem que fazer upload de imagens isoladamente, no h fotos sero salvas!</li></ul>\\n<strong>IMPORTAO&nbsp;COMPLETA&nbsp;DE DADOS:</strong>\\n<ul>\\n	<li>Esta importao ir importar todos os dados do VehicleManager e restaurar todos os campos e detalhes</li>\\n	<li>Esta opo ir substituir TODAS as entradas j existentes, portanto, tenha cuidado antes de a utilizar!</li>\\n	<li>Para salvar todas as fotos de veculos, por gentileza salve todos os arquivos da pasta: --components/com_vehiclemanager/photos--!</li>\\n	<li>Para salvar todos os documentos eletrnicos dos veculos, por gentileza salve todos os arquivos da pasta que voc selecionou para as definies do backend --Localizao de documentos'),(11377,367,15,'\\n<strong>CSV&nbsp;EXPORTAR:</strong>\\n<ul>\\n	<li>Exportao do CSV ir conter todos os campos para posterior edio adicional em um editor de texto ou um aplicativo de planilha</li>\\n	<li>Note, por gentileza, que para importaes subsequentes, somente o seguinte formato CSV  suportado: :&nbsp;&nbsp;ID do Veculo&nbsp;|&nbsp;Descrio&nbsp;|&nbsp;Link&nbsp;|&nbsp;Modelo&nbsp;|&nbsp;Tipo de Veculo&nbsp;|&nbsp;Tipo de listagem&nbsp;|&nbsp;Prio&nbsp;|&nbsp;Tipo de preo&nbsp;|&nbsp;Ttulo do Veculo&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Voc tambm pode importar mais tarde incluindo Revises de Veculos. Use exportao COMPLETA ao invs!</li>\\n</ul>\\n<strong>XML&nbsp;EXPORTAO:</strong>\\n<ul>\\n	<li>Exportao XML  a maneira preferida para exportar veculos com Descrio de Veculos</li>\\n	<li>Exportao XML com certeza ir conter todos os detalhes dos veculos, inlcuindo Descries, prontas para posteriores importaes</li>\\n  <li><strong>AVISO:</strong>&nbsp;associaes entre as casas no sero salvos!</li>\n        <li><strong>AVISO:</strong>&nbsp;voc tem que fazer upload de imagens isoladamente, no h fotos sero salvas!</li></ul>\\n<strong>EXPORTAO&nbsp;COMPLETA&nbsp;DE DADOS:</strong>\\n<ul>\\n	<li>Esta exportao ir exportar todos os dados do VehicleManager e salvar todos os campos e entradas</li>\\n	<li>Mais tarde voc pode usar esses arquivos para restaurar os dados do VehicleManager na ntegra</li>\\n	<li>Esta importao subsequente ir substituir TODAS as entradas j existentes, portanto, cuidado ao us-lo!</li>\\n	<li>Para restaurar todas as fotos do veculo, por gentileza restaure todos os arquivos da pasta: --components/com_vehiclemanager/photos--!</li>\\n	<li>Para restaurar todos os documentos eletrnicos, por gentileza restaure todos os arquivos da pasta que selecionou nas [Definies de Backend] -- [Localizao de documentos eletrnicos]</li>\\n</ul>'),(11378,368,15,'Enviar Notificaes de Reviso'),(11379,369,15,'Enviar Notificaes de Reviso'),(11380,370,15,'Defina como SIM se voc deseja ser notificado por e-mail quando um usurio adiciona uma Reviso de Veculos. Use o painel  direita para definir quem vai enviar essas notificaes. Voc pode definir os endereos de e-mail de recebimento em [ Configurao do Backend ].'),(11381,371,15,'Grupos de usurios, dos quais, notificaes de Reviso sero enviadas'),(11382,372,15,'Grupos de usurios, dos quais, notificaes de Reviso sero enviadas'),(11383,373,15,' Escolha qual grupo de usurios ir enviar notificaes de Reviso. Esta funo somente ser ativada se --Enviar Notificao de Reviso-- tambm estiver definido como SIM')