despre vehicul i fotografiile vehiculului pot fi introduse manual. <br/> <br />\\nNOTE: <br/>\\n- Pentru descrcare de fotografii de pe serverul dvs., trebuie s compilai PHP5, cu suport CURL <br />\\n- Pentru export CSV, avei nevoie s compilai PHP5 cu suport XSL <br/>\\n- Pentru CAPTCHA, avei nevoie s compilai PHP5, cu suport HG <br />\\n<br />\\nPe site-ul web <a href=\\\"http://www.ordasoft.com\\\"> www.ordasoft.com </a> puteti gasi Manualul VehicleManager, fiiere suplimentare de limb, forumuri de discuie i, de asemenea, descrca module suplimentare i plugin-uri. <Br />\\n<br />\\nNe este disponibil pentru Custom Development, dac dorii o nou caracteristic de adugat la VehicleManager, v rugm s expediai pe mail cerinele dumneavoastr la <a href=\\\"mailto:sales@ordasoft.com\\\"> sales@ordasoft.com </a> i vom lua legtura cu dvs. Vei primi urmatoarea versiune PRO cu facilitile particularizate dvs. adugate contra cost.'),(12139,286,16,'Cmpurile de mai jos trebuie doar s fie completate manual, atunci cnd ai setat'),(12140,287,16,'. Altfel ele vor fi ignorate.'),(12141,288,16,'Cerere de nchiriere'),(12142,289,16,'Lista arat vehiculele selectate pentru inchiriere. <br /> Dac este goal, v rugm s verificai selecia dvs. din nou.'),(12143,290,16,'Numele Dvs. complet'),(12144,291,16,'Adresa de e-mail'),(12145,292,16,'Adresa dvs. potal de coresponden'),(12146,293,16,'Data de intoarcere a vehiculului'),(12147,294,16,'nchiriere de la'),(12148,295,16,'Cerere dvs. de nchiriere a fost depozitat n baza noastr de date. Vom verifica cererea dumneavoastr i v vom informa ct mai curnd posibil. <br /> V mulumim pentru utilizarea serviciului nostru.'),(12149,296,16,'Cerere dvs. de cumprare a fost depozitat n baza noastr de date. Vom verifica cererea dumneavoastr i v vom informa ct mai curnd posibil. <br /> V mulumim pentru utilizarea serviciului nostru.'),(12150,297,16,'Sugestia dvs. a fost stocate n baza noastr de date. <br /> V mulumim pentru utilizarea serviciului nostru.'),(12151,298,16,'V