i o intreaga lista cu doar VehicleID, lsnd alte domenii goale, de exemplu: VehicleID | <i> gol </i> | <i> gol </i> | Model | <i> gol </i> | <i> gol </i> | Pret | <i> gol </i > | ... | </li>\\n<li> <strong> ATENIE: </strong> nu folosesc de import CSV, dac nu exist Review-uri de vehicule prezente, n acest caz, utilizai de import complet de date! </li>\\n</ul>\\n<strong> XML IMPORT: </strong>\\n<ul>\\n<li> De import n XML  </li>\\n<li> <strong> ATENIE: </strong> nu folosesc de import XML n cazul n care exist Review-uri de vehicule prezente, n acest caz, utilizai de import complet de date! </li>\\n<li><strong>ATENTIE:</strong>&nbsp;asociatii intre case nu vor fi salvate!</li>\n        <li><strong>ATENTIE:</strong>&nbsp;va trebui s ncrcai imagini individual, nicio fotografie vor fi salvate!</li></ul>\\n<strong> complet de date IMPORT: </strong>\\n<ul>\\nAcest lucru <li> de import va importa toate datele VehicleManager i refac toate domeniile i detalii </li>\\n<li> Aceast opiune va suprascrie Toate nscrierile existente, astfel nct s fie ateni atunci cnd se utilizeaz o! </li>\\n<li> Pentru a salva toate fotografiile Vehicule, v rugm s salvai toate fiierele din folderul: --components/com_vehiclemanager/photos--! </li>\\n<li> Pentru a salva tot eDocuments Vehicule, v rugm s salvai toate fiierele din folderul ceea ce ai stabilit n stabilirea backent - Locul edocuments -! </li>\\n</ul>'),(12220,367,16,'\\n<strong> CSV EXPORT: </strong>\\n<ul>\\n<li> De export CSV va conine toate cmpurile pentru editarea n continuare ntr-un editor de text sau de calcul tabelar de aplicare </li>\\n<li> V rugm s reinei c, pentru import ulterioare, numai dup urmtorul format CSV este suportat: VehicleID | Descriere | Link | Model | tip de vehicul | Listing tip de ; | Pret | Pret de tip | vehiculului Titlu | ... | </li>\\n<li> Avei posibilitatea s importai, de asemenea, mai trziu, inclusiv vehicule Review-uri, uz deplin de export n loc! </li>\\n</ul>\\n<strong> XML EXPORT: </strong>\\n<ul>\\n<li> De export XML este metoda preferat pentru a exporta vehicule cu descrieri de vehicule </li>\\n<li> De export XML va conine toate detaliile de vehicule, inclusiv descrieri, gata de import mai trziu </li>\\n<li><strong>ATENTIE:</strong>&nbsp;asociatii intre case nu vor fi salvate!</li>\n        <li><strong>ATENTIE:</strong>&nbsp;va trebui s ncrcai imagini individual, nicio fotografie vor fi salvate!</li></ul>\\n<strong> complet de date EXPORT: </strong>\\n<ul>\\nAcest lucru <li> de export va exporta toate datele VehicleManager i salva toate domeniile i intrrile </li>\\n<li> Putei utiliza ulterior aceste fiiere pentru a restaura datele dumneavoastr VehicleManager integral </li>\\nAcest lucru <li> de import ulterioare, va suprascrie Toate nscrierile existente, astfel nct s fie ateni atunci cnd se utilizeaz o! </li>\\n<li> Pentru a restaura toate fotografiile de vehicule, v rugm s restaurai toate fiierele din folderul: --components/com_vehiclemanager/photos--! </li>\\n<li> Pentru a restaura toate eDocuments vehiculului, v rugm s restaurai toate fiierele din folderul le-ai stabilit n [Settings Backend] - [Locatia edocuments] </li>\\n</ul>'),(12221,368,16,'Trimitei Review de notificare'),(12222,369,16,'Trimitei Review de notificare'),(12223,370,16,'Este setat pe Da, dac dorii s fii notificat prin e-mail atunci cnd un utilizator adaug un review de vehicul. Utilizai panoul din dreapta pentru a stabili cine va trimite aceste notificri. Putei seta adresele de e-mail primit n [Configurare Backend ].'),(12224,371,16,'Grupuri de utilizator de la care notificrile de revizuire va fi trimis'),(12225,372,16,'Grupuri de utilizator de la care notificrile de revizuire va fi trimis'),(12226,373,16,'Alege-grupuri de utilizatori, care va trimite notificri de revizuire. Aceast funcie va fi activat numai dac - Trimite Review de notificare - este, de asemenea setat pe Da'),(12227,374,16,'Trimitei Sugestie de notificare'),(12228,375,16,'Trimitei Sugestie de notificare'),(12229,376,16,'Este setat