culo ]'),(13885,342,18,'Sugerencia de vehculo'),(13886,343,18,'Ttulo de la sugerencia'),(13887,344,18,'Comentario de la sugerencia'),(13888,345,18,'Por favor escriba un Ttulo para su sugerencia!'),(13889,346,18,'Por favor escriba un Texto para su sugerencia!'),(13890,347,18,'VehicleManager :: Sugerencias'),(13891,348,18,'Borrar Sugerencia'),(13892,349,18,'Ver Sugerencia'),(13893,350,18,'Mostrar Botn [ Comprar ahora ]'),(13894,351,18,'Mostrar Botn [ Comprar ahora ]'),(13895,352,18,'Mostrar Botn [ Comprar ahora ] al lado del vehculo en la interfse de usuario'),(13896,353,18,'Permitir Botn [ Comprar Ahora ]:'),(13897,354,18,'Mostrar Botn [ Comprar ahora ] en la interfase de usuario para categoras seleccionadas. Esta funcin solo se activar si --Mostrar Botn [ Comprar ahora ]-- tambin est definida como SI! Usted puede seleccionar varias categoras.'),(13898,355,18,'Permitir Botn [ Comprar Ahora ]'),(13899,356,18,'Exportacin completa'),(13900,357,18,'Importacin completa'),(13901,358,18,'Esta operacin remover TODA la informacin existente de VehicleManager antes de importar. Quiere continuar?'),(13902,359,18,'[ Ocultar Sugerencia ]'),(13903,360,18,'Mostrar Botn<br />[ Sugerir Vehculo ]'),(13904,361,18,'Mostrar Botn<br />[ Sugerir Vehculo ]'),(13905,362,18,'Mostrar Botn [ Sugerir Vehculo ] en la lista de vehculos y en los detalles de vehculos en la interfase de usuario'),(13906,363,18,'Permitir Botn<br />[ Sugerir Vehculo ]'),(13907,364,18,'Permitir Botn<br />[ Sugerir Vehculo ]'),(13908,365,18,'Permitir Botn<br />[ Sugerir Vehculo ] en la interfase de usuario. Esta funcin solo se activar si --Mostrar Botn [ Sugerir Vehculo ]-- tambin est definida como SI!'),(13909,366,18,'\\n<strong>CSV&nbsp;IMPORT:</strong>\\n<ul>\\n	<li>En el momento es soportado el siguiente formato CSV:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Los campos se separan con el caracter tubera (pipe) (<strong>&nbsp;|&nbsp;</strong>)</li>\\n	<li>Usted puede importar una lista completa con el solo VehicleID dejando los otros campos vacos, por ejemplo:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;<i>vaco</i>&nbsp;|&nbsp;<i>vaco</i>&nbsp;|&nbsp;Model&nbsp;|&nbsp;<i>vaco</i>&nbsp;|&nbsp;<i>vaco</i>&nbsp;|&nbsp;Price&nbsp;|&nbsp;<i>vaco</i>&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li><strong>PRECAUCIN:</strong>&nbsp;no use la importacin CSV si hay Observaciones de vehculos presentes. En ese caso, use importacin completa!</li>\\n</ul>\\n<strong>XML&nbsp;IMPORTAR:</strong>\\n<ul>\\n	<li>importar en formato XML</li>\\n	<li><strong>PRECAUCIN:</strong>&nbsp;no use la importacin XML si hay Observaciones de vehculos presentes. En ese caso, use importacin completa!</li>\\n      <li><strong>ALERTA:</strong>&nbsp;No se guardarn las asociaciones entre las casas!</li>\n        <li><strong>ALERTA:</strong>&nbsp;lo que tienes que subir imgenes solos, no hay fotos se guardarn!</li></ul>\\n<strong>FULL&nbsp;DATA&nbsp;IMPORTAR:</strong>\\n<ul>\\n	<li>Esta importacin importar toda la informacin de VehicleManager y restaurar todos los campos y detalles</li>\\n	<li>Esta opcin sobreescribir TODAS las entradas existentes, sea cuidadoso al usarla!</li>\\n	<li>Para guardar todas las fotos de vehculos, por favor guarde todos los archivos de la carpeta: --components/com_vehiclemanager/photos--!</li>\\n	<li>Para guardar todos los eDocuments de vehculos, por favor guarde todos los archivos de la carpeta que defini en --Location of edocuments--!</li>\\n</ul>'),(13910,367,18,'\\n<strong>CSV&nbsp;EXPORTAR:</strong>\\n<ul>\\n	<li>La exportacin CSV contendr todos los campos para edicin adicional en un editor de texto o una hoja de clculo</li>\\n	<li>por favor note que para importaciones subsecuentes, solo es soportado el siguiente formato CSV:&nbsp;&nbsp;VehicleID&nbsp;|&nbsp;Description&nbsp;|&nbsp;Link&nbsp;|&nbsp;Model&nbsp;|&nbsp;Vehicle type&nbsp;|&nbsp;Listing type&nbsp;|&nbsp;Price&nbsp;|&nbsp;Price type&nbsp;|&nbsp;Vehicle Title&nbsp;|&nbsp;...&nbsp;|</li>\\n	<li>Usted tambin puede importar despus incluyendo Observaciones de vehculos, use en cambio exportacin COMPLETA!</li>\\n</ul>\\n<strong>XML&nbsp;EXPORTAR:</strong>\\n<ul>\\n	<li>La exportacin XML es la manera preferida para exportar vehculos con sus descripciones</li>\\n	<li>La exportacin XML contendr todos los detalles de vehculos, incluyendo Descripciones, listos para importancin posterior</li>\\n   <li><strong>ALERTA:</strong>&nbsp;No se guardarn las asociaciones entre las casas!</li>\n        <li><strong>ALERTA:</strong>&nbsp;lo que tienes que subir imgenes solos, no hay fotos se guardarn!</li></ul>\\n<strong>FULL&nbsp;DATA&nbsp;EXPORTAR:</strong>\\n<ul>\\n	<li>Esta exportacin exportar toda la informacin de VehicleManager y restaurar todos los campos y detalles</li>\\n	<li>Usted puede usar despus estos archivos para restaurar completamente su informacin de VehicleManager</li>\\n	<li>Esta importacin subsecuente reescribirpa TODAS las entradas existentes. Sea cuidadoso cuendo la use!</li>\\n	<li>Para restaurar todas las fotos de vehculos, por favor restaure todos los archivos de la carpeta: --components/com_vehiclemanager/photos--!</li>\\n	<li>Para restaurar todos los eDocuments de vehculos, por favor restaure todos los archivos de la carpeta que defini en [Configuracin Administrador] -- [ubicacin de edocuments]</li>\\n</ul>'),(13911,368,18,'Enviar Notificacin de Observaciones'),(13912,369,18,'Enviar Notificacin de Observaciones'),(13913,370,18,'Definir SI en caso que quiera ser notificado por email cuando un usuario agrega una observacin.  Use el panel de la derecha para definir quien enviar esas notificaciones. Usted puede definir las direcciones de recibo en  [ Configuracin Administrador ].'),(13914,371,18,'Grupos de usuarios desde los cuales se enviarn notificaciones de Observaciones'),(13915,372,18,'Grupos de usuarios desde los cuales